INSERT INTO `ps_cms_lang` VALUES (1,1,1,'Delivery','','Our terms and conditions of delivery','conditions, delivery, delay, shipment, pack','<div class=\"boxhead\"><span> <img src=\"/libraries/images/1px.gif\" alt=\"\" class=\"px1\" /> Koszty Dostawy </span></div>\n<div class=\"innerbox\">\n<div class=\"resetcss fr-view\">\n<p style=\"text-align:left;color:#000000;\"><strong>1) Krajowa Wysyłka Pocztą Polską: </strong></p>\n<p style=\"text-align:left;color:#000000;\">Wszystkie przesyłki wysyłamy ubezpieczoną lub wartościową (w zależności od zawartości) Pocztex 2.0 za pośrednictwem: <a title=\"Poczta Polska\" href=\"https://www.poczta-polska.pl/\" target=\"_blank\" rel=\"noreferrer noopener\">Poczty Polskiej</a> w cenie uzależnionej od wartości przesyłki: </p>\n<p style=\"text-align:left;color:#000000;\">Wartość zamówionych przedmiotów <strong>do 1000 zł</strong>    -  koszt ubezpieczonej / wartościowej paczki <strong>20 ZŁ</strong></p>\n<p style=\"text-align:left;color:#000000;\">Wartość zamówionych przedmiotów <strong>do 2000 zł   </strong> -  koszt ubezpieczonej / wartościowej paczki <strong>30 ZŁ</strong> </p>\n<p style=\"text-align:left;color:#000000;\">Wartość zamówionych przedmiotów <strong>do 5000 zł</strong>    -  koszt ubezpieczonej / wartościowej paczki <strong>80 ZŁ</strong></p>\n<p style=\"text-align:left;color:#000000;\">Wartość zamówionych przedmiotów <strong>do 10 000 zł</strong> -  koszt ubezpieczonej / wartościowej paczki <strong>180 ZŁ</strong></p>\n<p style=\"text-align:left;color:#000000;\">Wartość zamówionych przedmiotów <strong>do 20 000 zł </strong>-  koszt ubezpieczonej / wartościowej paczki <strong>350 ZŁ</strong></p>\n<p style=\"text-align:left;color:#000000;\">Wartość zamówionych przedmiotów <strong>do 30 000 zł </strong>-  koszt ubezpieczonej / wartościowej paczki <strong>500 ZŁ</strong></p>\n<p style=\"text-align:left;color:#000000;\">Wartość zamówionych przedmiotów <strong>do 40 000 zł </strong>-  koszt ubezpieczonej / wartościowej paczki <strong>700 ZŁ</strong></p>\n<p style=\"text-align:left;color:#000000;\">Maksymalna wartość jednej paczki to <strong>40 000 zł</strong></p>\n<p style=\"text-align:left;color:#000000;\">Wysyłka za pobraniem (płatne przy odbiorze) to dodatkowy koszt <strong>5 ZŁ</strong><strong> </strong></p>\n<p> </p>\n<p> </p>\n<p style=\"text-align:left;color:#000000;\"><strong>2) Krajowa Wysyłka UPS</strong></p>\n<p style=\"text-align:left;color:#000000;\">Wartość zamówionych przedmiotów <strong>do 10 000 zł</strong> -  koszt ubezpieczonej / wartościowej paczki <strong>30 ZŁ</strong></p>\n<p style=\"text-align:left;color:#000000;\">Wysyłka za pobraniem (płatne przy odbiorze) to dodatkowy koszt <strong>8 ZŁ </strong><strong> </strong></p>\n<p> </p>\n<p style=\"text-align:left;color:#000000;\"><strong>3) Paczkomaty InPost</strong></p>\n<p style=\"text-align:left;color:#000000;\">Wartość zamówionych przedmiotów <strong>do 20 000 zł</strong> -  koszt ubezpieczonej / wartościowej paczki <strong>18 ZŁ</strong></p>\n<p style=\"text-align:left;color:#000000;\"> </p>\n<p style=\"text-align:left;color:#000000;\"><strong>4) Kurier InPost</strong></p>\n<p style=\"text-align:left;color:#000000;\">Wartość zamówionych przedmiotów <strong>do 10 000 zł</strong> -  koszt ubezpieczonej / wartościowej paczki <strong>20 ZŁ</strong></p>\n<p style=\"text-align:left;color:#000000;\">Wysyłka za pobraniem (płatne przy odbiorze) to dodatkowy koszt <strong>5 ZŁ </strong><strong> </strong></p>\n<p style=\"text-align:left;color:#000000;\"> </p>\n<p style=\"text-align:left;color:#000000;\"><strong>5) Zagraniczna Wysyłka (international shipping) UPS :</strong></p>\n<p style=\"text-align:left;color:#000000;\">Ubezpieczenie <strong>do 10 000 zł</strong> UNIA EUROPEJSKA   -  <strong>koszt paczki 80 ZŁ </strong></p>\n<p> </p>\n<p> </p>\n<h2 style=\"text-align:left;color:#000000;\"><strong>Przesyłanie monet - dlaczego takie drogie ?</strong></h2>\n<p style=\"text-align:justify;color:#000000;\">Szanowni Klienci: przesyłanie monet złotych i srebrnych, które jednocześnie są pełnoprawnym środkiem płatniczym wymaga deklaracji wartości a nie zwykłego ubezpieczenia, dlatego w/w koszty są tak odczuwalne wraz ze wzrostem wartości przesyłanych wartości kolekcjonerskich. Bezpieczeństwo i komfort przy dostawie jest jednym z naszych priorytetów dlatego dokładamy najwyższej staranności aby przesyłki były prawidłowo zabezpieczone zarówno fizycznie (pakowanie) jak i formalnie (zgłaszanie wartości) tak żeby w razie np. zaginięcia przesyłki nikt nie był narażony na straty.</p>\n<p> </p>\n<p> </p>\n<p style=\"text-align:center;color:#000000;\">Istnieje możliwość bezpłatnego odbioru towaru w naszym sklepie stacjonarnym:</p>\n<p style=\"text-align:center;color:#000000;\"><strong>KATOWICE 40-008</strong></p>\n<p style=\"text-align:center;color:#000000;\"><strong>UL. WARSZAWSKA 26</strong></p>\n<p style=\"text-align:center;color:#000000;\"><strong>TEL. 502 210 907</strong></p>\n</div>\n</div>','delivery'),(2,1,1,'Legal Notice','','Legal notice','notice, legal, credits','<p style=\"text-align:center;color:#000000;\"><strong>Klauzula informacyjna</strong></p>\n<p style=\"text-align:center;color:#000000;\"><strong>dot. zasad przetwarzania danych osobowych w sklepie internetowym</strong></p>\n<p style=\"text-align:center;color:#000000;\"><strong>numizmatyczny.com</strong></p>\n<p> </p>\n<ol>\n<li style=\"text-align:justify;color:#000000;\">Administratorem Pani/Pana danych osobowych jest Jakub Starański prowadzący działalność gospodarczą pod firmą JS Partner Jakub Starański wpisaną do Centralnej Ewidencji i Informacji o Działalności Gospodarczej Rzeczypospolitej Polskiej prowadzonej przez ministra właściwego do spraw gospodarki, posiadająca: adres miejsca wykonywania działalności i adres do doręczeń: ul. Warszawska 26, Katowice (40 – 008), NIP: 6412419384, REGON: 243535017, adres poczty elektronicznej: sklep@numizmatyczny.com, numer telefonu: 512 353 791.</li>\n<li style=\"text-align:justify;color:#000000;\">Administrator zbiera dane osobowe wyłącznie w celu rejestracji i prowadzenia konta użytkownika, newslettera, zawarcia i wykonania umowy sprzedaży lub innego rodzaju umowy, przede wszystkim tzw. abonamentu numizmatycznego.</li>\n<li style=\"text-align:justify;color:#000000;\">Administrator przetwarza dot. Pani/Pana dane osobowe na podstawie:\n<ol style=\"color:#000000;\">\n<li>6 ust. 1 lit. a) RODO tj. zgody osoby, której dane dotyczą, na tej podstawie przetwarzane są dane przede wszystkim w związku z rejestracją i prowadzeniem konta oraz przesyłania newslettera, oraz maili transakcyjnych.</li>\n<li>6 ust. 1 lit. b) RODO tj. przetwarzanie jest niezbędne do wykonania umowy, której stroną jest osoba, której dane dotyczą, lub do podjęcia działań na żądanie osoby, której dane dotyczą, przed zawarciem umowy. W oparciu o tę podstawę Administrator przetwarza dane na potrzeby wykonywania umów, przede wszystkim umów sprzedaży i umów abonamentowych.</li>\n<li>6 ust. 1 lit. c) RODO tj. przetwarzanie jest niezbędne do wypełnienia obowiązku prawnego ciążącego na administratorze. Oznacza to przede wszystkim przechowywanie danych osobowych przez okres wymagany przepisami prawa.</li>\n<li>6 ust. 1 lit. f) RODO tj. wykonywanie prawnie uzasadnionych interesów Administratora takich jak obrona roszczeń czy dochodzenie należności, a także prowadzenie marketingu bezpośredniego.</li>\n</ol>\n</li>\n<li style=\"text-align:justify;color:#000000;\">Odbiorcami dotyczących Pani/Pana danych osobowych mogą być Shoper.pl (dostawca platformy obsługującej sklep internetowy), Biuro rachunkowe ENTER w Rudzie Śląskiej, Poczta Polska, AutoPay S.A. (dostawca rozwiązań do obsługi płatności), PayU S.A. (dostawca rozwiązań do obsługi płatności), Edrone Sp. z o.o., ul. Lekarska 1, 31-203 Kraków, NIP: 676-248-20-64, KRS: 0000537197 – w celu korzystania z systemu mailingowego edrone.me, służącego do przesyłania newslettera oraz w celach marketingowych tylko i wyłącznie na potrzeby kampanii emali, sms, social media uruchomionej lub wskazanej przez Administratora za pomocą systemu edrone.</li>\n<li style=\"text-align:justify;color:#000000;\">W przypadku danych przetwarzanych na podstawie zgody, Administrator przetwarza je do czasu jej wycofania. W pozostałych przypadkach, Administrator przetwarza dane osobowe przez czas realizacji umowy, a po jej zakończeniu przez okres przedawnienia roszczeń tj. 6 lat, okres ten może ulec wydłużeniu w przypadku zgłoszenia reklamacji.</li>\n<li style=\"text-align:justify;color:#000000;\">Ma Pani/Pan prawo do:\n<ol style=\"color:#000000;\">\n<li>żądania od Administratora dostępu do danych osobowych,</li>\n<li>żądania od Administratora sprostowania danych,</li>\n<li>żądania od Administratora usunięcia lub ograniczenia przetwarzania danych,</li>\n<li>wniesienia sprzeciwu wobec przetwarzania,</li>\n<li>przenoszenia danych osobowych,</li>\n<li>wniesienia skargi do Prezesa Urzędu Ochrony Danych Osobowych,</li>\n<li>cofnięcia zgody wdowolnym momencie, bez wpływu na zgodność z prawem przetwarzania, którego dokonano na podstawie zgody przed jej cofnięciem.</li>\n</ol>\n</li>\n<li style=\"text-align:justify;color:#000000;\">Przekazanie danych osobowych jest niezbędne do prawidłowej rejestracji, zawarcia oraz wykonania umowy. Odmowa przekazania danych osobowych uniemożliwi wykonanie umowy, a wcześniej także rejestrację.</li>\n<li style=\"text-align:justify;color:#000000;\">Administrator na podstawie pozyskanych danych nie podejmuje decyzji w sposób zautomatyzowany, w tym nie dokonuje na ich podstawie profilowania.</li>\n<li style=\"text-align:justify;color:#000000;\">Administrator informuje, że stosuje następujące technologie śledzące działania podejmowane przez użytkownika/Klienta w ramach strony internetowej Sklepu: kody śledzenia edrone – w celu analizy statystyk strony internetowej Sklepu, a także w celach marketingowych tylko i wyłącznie na potrzeby kampanii e-mali, sms, social media uruchomionej lub wskazanej przez Administratora za pomocą systemu edrone.</li>\n</ol>\n<p> </p>','legal-notice'),(3,1,1,'Terms and conditions of use','','Our terms and conditions of use','conditions, terms, use, sell','<div class=\"boxhead\"><span> <img src=\"/libraries/images/1px.gif\" alt=\"\" class=\"px1\" /> Zwroty i reklamacje </span></div>\n<div class=\"innerbox\">\n<div class=\"resetcss fr-view\">\n<p style=\"text-align:center;color:#000000;\"><strong>Zwroty i reklamacje w sklepie internetowym</strong></p>\n<p style=\"text-align:center;color:#000000;\"><strong>numizmatyczny.com</strong></p>\n<p><strong>Definicje</strong></p>\n<p>1. Operator – właściciel Sklepu i podmiot nim zarządzający, którym jest JS Partner Jakub Starański, NIP: 6412419384 z siedzibą w Katowicach, przy ul. Warszawska 26, 40-008 Katowice.</p>\n<p>2. Zamawiający, Klient – Użytkownik, który dokonał zamówienia w Sklepie.</p>\n<p><strong>Zasady reklamacji</strong></p>\n<p>1. Reklamacje rozpatrywane są w ciągu 14 dni kalendarzowych od ich złożenia.</p>\n<p>2. Zgłoszenie reklamacji powinno nastąpić drogą e-mailową na adres sklep@numizmatyczny.com<a href=\"mailto:office%28malpa%29goldco.pl%20\"> </a>lub poprzez operatora pocztowego na adres: JS Partner Jakub Starański, NIP: 6412419384 z siedzibą w Katowicach, przy ul. Warszawska 26, 40-008 Katowice. Należność wraz z poniesionymi przez Zamawiającego kosztami przesyłki reklamowanego towaru zostanie zwrócona niezwłocznie, nie później niż w ciągu 14 dni kalendarzowych licząc od odebrania przez Operatora reklamowanego towaru. Zwrot należności następuje na wskazany przez Zamawiającego rachunek bankowy.</p>\n<p>3. Istnieje możliwość skorzystania z pozasądowych sposobów rozpatrywania reklamacji.</p>\n<p>3.1. Klient uprawniony jest do zwrócenia się do stałego polubownego sądu konsumenckiego działającego przy Inspekcji Handlowej z wnioskiem o rozstrzygnięcie sporu wynikłego z zawartej Umowy Sprzedaży.</p>\n<p>3.2. Klient uprawniony jest do zwrócenia się do wojewódzkiego inspektora Inspekcji Handlowej z wnioskiem o wszczęcie postępowania mediacyjnego w sprawie polubownego zakończenia sporu między Klientem, a Sprzedawcą.</p>\n<p>3.3 Klient może uzyskać bezpłatną pomoc w sprawie rozstrzygnięcia sporu między Klientem, a Sprzedawcą, korzystając także z bezpłatnej pomocy powiatowego (miejskiego) rzecznika konsumentów lub organizacji społecznej, do której zadań statutowych należy ochrona konsumentów (m.in. Federacja Konsumentów, Stowarzyszenie Konsumentów Polskich). Porady udzielane są pod przez Federację Konsumentów pod bezpłatnym numerem infolinii konsumenckiej 800 007 707 oraz przez Stowarzyszenie Konsumentów Polskich.</p>\n<p>4. JS Partner Jakub Starański. zobowiązuje się i gwarantuje dostawę rzeczy wolnych od wszelkich wad (za wady nie uznaje się mikro zarysowań na produktach ze złota inwestycyjnego oraz ich opakowaniach, ponieważ wartość złota inwestycyjnego zależy tylko i wyłącznie od ilości zawartego w nim złota).</p>\n<p><strong>Zwroty towaru i odstąpienie od umowy</strong></p>\n<p>1. Zgodnie z Ustawą o Prawach Konsumenta z dnia 30 maja 2014 roku Operator PRZYJMUJE zwroty Towarów, których cena NIE ZALEŻY od wahań na rynku finansowym, nad którymi przedsiębiorca nie sprawuje kontroli i które mogą wystąpić przed upływem terminu do odstąpienia od umowy. Zgodnie z Rozdziałem 5 art. 40 ust. 6 Ustawodawca zaliczył do grupy NIE OBJĘTYCH prawem odstąpienia od umowy przez Konsumenta, towary nabywane w postaci złota i metali szlachetnych, złotych oraz srebrnych monet i sztabek.</p>\n<p>Zwrot towaru innego niż złoto i srebro inwestycyjne powinien nastąpić w ciągu 14 dni od objęcia rzeczy w posiadanie przez Zamawiającego.</p>\n<p>2. Zamawiający może odstąpić od umowy w terminie do 14 dni od objęcia towaru w posiadanie składając Operatorowi oświadczenie o odstąpieniu od umowy. Oświadczenie można złożyć wysyłając je pocztą na adres JS Partner Jakub Starański, ul. Warszawska 26, 40-008 Katowice. lub w formie elektronicznej przesyłając drogą mailową na adres sklep@numizmatyczny.com </p>\n<p>3. Operator niezwłocznie po otrzymaniu informacji o odstąpieniu od umowy prześle Zamawiającemu na wskazany adres poczty elektronicznej potwierdzenie otrzymania oświadczenia o odstąpieniu od umowy.</p>\n<p>4. Operator niezwłocznie, nie później niż w terminie 14 dni od dnia otrzymania oświadczenia Zamawiającego o odstąpieniu od umowy, zwraca Zamawiającemu wszystkie dokonane przez niego płatności, w tym koszty dostarczenia rzeczy.</p>\n<p>5. Operator dokonuje zwrotu płatności na wskazany przez Zamawiającego nr rachunku bankowego.</p>\n</div>\n</div>','terms-and-conditions-of-use'),(4,1,1,'About us','','Learn more about us','about us, informations','<div class=\"boxhead\"><span> <img src=\"/libraries/images/1px.gif\" alt=\"\" class=\"px1\" /> Jak opisujemy </span></div>\n<div class=\"innerbox\">\n<div class=\"resetcss fr-view\">\n<div style=\"text-align:justify;color:#000000;\"><span style=\"font-size:12pt;\">Drogi kliencie:</span></div>\n<div style=\"text-align:justify;color:#000000;\"> </div>\n<div style=\"text-align:justify;color:#000000;\"><span style=\"font-size:12pt;color:#000000;\"><span style=\"font-size:12pt;\">jako kolekcjoner i właściciel sklepu Numizmatyczny.Com bardzo przykładam się do opisywania sprzedawanych monet w szczególności tych pochodzących z rynku wtórnego tj. np z aukcji, skupu komisowego, obrotu między kolekcjonerami. Często zdarzało mi się (i nadal zdarza) kupić monetę na aukcji internetowej od prywatnego kolekcjonera która po jej otrzymaniu okazywała się znacząco odbiegać od tego co widziałem na zdjęciach. Takie sytuacje nie należą do przyjemnych i nie życzę nikomu takich rozczarowań dlatego w naszym sklepie zdjęcia robione są w taki sposób abyś Ty jako kolekcjoner miał pewność i świadomość stanu monety którą od nas kupujesz. Patyna, przebarwienia, ryski, uszkodzenia, kurz na lustrze to detale które można ukryć robiąc celowo nieodpowiednie zdjęcia. W Numizmatyczny.Com chcemy abyś Ty</span></span><span style=\"font-size:12pt;color:#000000;\"> jako klient miał pełną wiedzę na temat stanu oferowanych u nas monet i banknotów w związku z tym jesteśmy na tym punkcie wyczuleni i dokładamy wszelkich starań aby zdjęcia i opisy zawierały wszystkie istotne informację o stanie sprzedawanych walorów. Nasze zdjęcia nie są poddawane obróbce graficznej. </span></div>\n<div style=\"text-align:justify;color:#000000;\"><span style=\"font-size:12pt;color:#000000;\"> </span></div>\n<div style=\"text-align:justify;color:#000000;\"><span style=\"font-size:12pt;color:#000000;\">Każda sprzedawana przez nas moneta ma na swojej stronie informację o użytym zdjęciu i ewentualnie jego pochodzeniu. Poniżej przedstawiam rozszerzoną informację o użytych zdjęciach: </span></div>\n<ul>\n<li style=\"text-align:justify;color:#000000;\">\n<h2><span style=\"font-size:14pt;color:#000000;\"><strong>Zdjęcie podglądowe z NBP </strong></span></h2>\n<span style=\"font-size:12pt;color:#000000;\">kupując na stronie z takim opisem oznacza to że dany walor pochodzi bezpośrednio z NBP, obrotu między firmami numizmatycznymi, prosto z worka lub pudełka menniczego i moneta jest w stanie absolutnie menniczym bez śladów palców, rys i uszkodzeń uznanych przez NBP jako cecha nieakceptowalna: <a title=\"NBP - Cechy produkcyjne\" href=\"/public/assets/pliki/Katalog_cech_produkcyjnych.pdf\">NBP - Cechy produkcyjne</a>. Na stronach z taką informacją używamy zdjęć monet pochodzących z <a title=\"NBP\" href=\"http://www.nbp.pl\" target=\"_blank\" rel=\"noreferrer noopener\">www.nbp.pl</a> </span></li>\n</ul>\n<p> </p>\n<ul>\n<li style=\"text-align:justify;color:#000000;\">\n<h2><strong><span style=\"font-size:14pt;color:#000000;\"><strong>Zdjęcie podglądowe z NBP oraz Własne </strong></span></strong></h2>\n<span style=\"font-size:12pt;\">taki opis oznacza, że oprócz zdjęć z <a title=\"NBP\" href=\"http://www.nbp.pl\" target=\"_blank\" rel=\"noreferrer noopener\">www.nbp.pl</a> użyto własnych zdjęć podglądowych. Stan waloru jest identyczny jak w przypadku oznaczenia \"Zdjęcie podglądowe z NBP\".</span></li>\n</ul>\n<p> </p>\n<ul>\n<li style=\"text-align:justify;color:#000000;\">\n<h2><strong><span style=\"font-size:14pt;color:#000000;\"><strong>Zdjęcie autentyczne oferowanej monety </strong></span></strong></h2>\n<span style=\"font-size:12pt;\">taki opis oznacza, że zdjęcie przedstawiają rzeczywisty stan oferowanego waloru. Kupujesz dokładnie przedmiot ze zdjęcia.  </span></li>\n</ul>\n<p> </p>\n<p> </p>\n<p> </p>\n<p><img style=\"margin-left:auto;margin-right:auto;\" src=\"/public/assets/images/ma%C5%82y21.png\" alt=\"\" /></p>\n</div>\n</div>','about-us'),(5,1,1,'Secure payment','','Our secure payment mean','secure payment, ssl, visa, mastercard, paypal','<div class=\"box resetcss box_custom none\" id=\"kategorieo\">\n<div class=\"innerbox\"></div>\n</div>\n<div class=\"box box_infopage\" id=\"infopage8\">\n<div class=\"boxhead\"><span> <img src=\"/libraries/images/1px.gif\" alt=\"\" class=\"px1\" /> Sposoby Płatności </span></div>\n<div class=\"innerbox\">\n<div class=\"resetcss fr-view\">\n<p><span style=\"font-family:arial, helvetica, sans-serif;font-size:18pt;color:#000000;\">Sklep Numizmatyczny.com</span></p>\n<p style=\"color:#000000;\">Obsługiwane sposoby płatności w naszym sklepie:</p>\n<ol>\n<li><span style=\"font-size:10pt;color:#000000;\"><strong>Płatność za pobraniem przy odbiorze przesyłki (płatne dodatkowo +5zł)</strong></span></li>\n<li><span style=\"font-size:10pt;color:#000000;\"><strong>Płatność gotówką przy odbiorze osobistym.</strong></span></li>\n<li><span style=\"font-size:10pt;color:#000000;\"><strong>Płatność przelewem na rachunek bankowy.</strong></span></li>\n<li><span style=\"font-size:10pt;color:#000000;\"><strong>Płatność za pośrednictwem serwisu <a title=\"PayU\" href=\"https://www.payu.pl/\" target=\"_blank\" rel=\"noreferrer noopener\">PayU</a></strong></span></li>\n<li><span style=\"font-size:10pt;color:#000000;\"><strong>Płatność BLIK, Google Pay, Apple Pay</strong></span></li>\n<li><span style=\"font-size:10pt;color:#000000;\"><strong>Płatności elektroniczne i płatności kartą płatniczą:</strong></span></li>\n</ol>\n<p> </p>\n<p style=\"text-align:center;\"><span style=\"font-size:10pt;color:#000000;\">   <strong>Obsługiwane karty płatnicze:</strong></span></p>\n<p style=\"text-align:center;\"><span style=\"font-size:10pt;color:#000000;\"><strong>            Visa; Visa Electron; MasterCard; MasterCard Electronic; Maestro</strong></span></p>\n<p style=\"text-align:center;\"><span style=\"font-size:10pt;color:#000000;\">           <strong>Rozliczenia płatności online przeprowadzane są przez Autopay S.A. (</strong><a href=\"https://https//autopay.pl/\" target=\"_blank\" rel=\"noreferrer noopener\"><strong>autopay.pl</strong></a><strong>)</strong></span></p>\n<p> </p>\n<p style=\"text-align:center;color:#000000;\"><img src=\"https://numizmatyczny.com/userdata/public/assets/bannery/platnosci_pion_banki_z_kartami.png\" alt=\"https://autopay.pl/\" width=\"350\" /></p>\n</div>\n</div>\n</div>','secure-payment'),(6,1,1,'Nowości','','','','<div id=\"klocek1\"></div>','nowosci'),(7,1,1,'Abonament 2026','','','','<p style=\"text-align:justify;\"><strong>Abonament Numizmatyczny</strong> na rok 2026 przygotowaliśmy w 2 wersjach:</p>\n<p style=\"text-align:justify;\"><strong>Srebrny:</strong>  obejmuje, srebrne monety kolekcjonerskie o nominałach 10 zł, 20 zł, 50 zł oraz banknot kolekcjonerski. </p>\n<p style=\"text-align:justify;\"><strong>Złoty:</strong>  obejmuje wszystkie złote monety.</p>\n<p style=\"text-align:justify;\">Kupując abonament numizmatyczny (opłata jednorazowa na cały rok) monety kupujesz w cenach emisyjnych ustalonych przez NBP - taniej się nie da ! Setki zadowolonych klientów, bogata oferta monet i banknotów oraz stałe rabaty dla klientów posiadających abonament numizmatyczny - przemyśl to ! Ilość Abonamentów Ograniczona ! </p>\n<p><strong>Uwaga !</strong> Skład monet w powyższych abonamentach dotyczy planu emisyjnego aktualnego na dzień 00.00.2025 r. W sytuacji gdy do planu zostanie dodana jakaś pozycja (np. moneta lub banknot) nie ma gwarancji uzyskania ceny emisyjnej. Przed zakupem sprawdź plan i listę monet które wchodzą w skład abonamentu:</p>\n<p style=\"text-align:justify;\"><a title=\"Plan Emisji Monet i Banknotów NBP - 2026 rok\" href=\"/userdata/public/assets//plan-2026-pl.pdf\" target=\"_blank\" rel=\"noreferrer noopener\">Wiążący przy zakupie Plan Emisji Monet i Banknotów na Rok 2026 - Sprawdź Tutaj.</a></p>','abonament-2026'),(8,1,1,'regulamin','','','','<div class=\"resetcss fr-view\">\n<p style=\"text-align:center;\"><span style=\"font-size:12pt;color:#000000;\"><strong>REGULAMIN SKLEPU INTERNETOWEGO </strong></span></p>\n<p style=\"text-align:center;\"><span style=\"font-size:12pt;color:#000000;\"><strong>NUMIZMATYCZNY.COM</strong></span></p>\n<p> </p>\n<p><span style=\"font-size:10pt;color:#000000;\"><strong>SPIS TREŚCI: </strong></span></p>\n<ol>\n<li><span style=\"color:#000000;font-size:10pt;\">POSTANOWIENIA OGÓLNE</span></li>\n<li><span style=\"color:#000000;font-size:10pt;\">RODZAJE I ZAKRES USŁUG ŚWIADCZONYCH DROGĄ ELEKTRONICZNĄ</span></li>\n<li><span style=\"color:#000000;font-size:10pt;\">WARUNKI ZAWIERANIA I WYPOWIADANIA UMOWY SPRZEDAŻY</span></li>\n<li><span style=\"color:#000000;font-size:10pt;\">ODSTĄPIENIE OD UMOWY</span></li>\n<li><span style=\"color:#000000;font-size:10pt;\">SPOSOBY I TERMINY PŁATNOŚCI ZA PRODUKT</span></li>\n<li><span style=\"color:#000000;font-size:10pt;\">KOSZT, SPOSOBY I TERMIN DOSTAWY ORAZ ODBIORU PRODUKTU</span></li>\n<li><span style=\"color:#000000;font-size:10pt;\">REKLAMACJA PRODUKTU</span></li>\n<li><span style=\"color:#000000;font-size:10pt;\">POZASĄDOWE SPOSOBY ROZPATRYWANIA REKLAMACJI I DOCHODZENIA ROSZCZEŃ ORAZ ZASADY DOSTĘPU DO TYCH PROCEDUR</span></li>\n<li><span style=\"color:#000000;font-size:10pt;\">POSTANOWIENIA DOTYCZĄCE KLIENTÓW NIEBĘDĄCYCH KONSUMENTAMI</span></li>\n<li><span style=\"color:#000000;font-size:10pt;\">POSTANOWIENIA KOŃCOWE</span></li>\n</ol>\n<p> </p>\n<p style=\"text-align:justify;color:#000000;\"><em>Sklep Internetowy www.numizmatyczny.com dba o prawa konsumenta. Konsument nie może zrzec się praw przyznanych mu w Ustawie o Prawach Konsumenta. Postanowienia umów mniej korzystne dla konsumenta niż postanowienia Ustawy o Prawach Konsumenta są nieważne, a w ich miejsce stosuje się przepisy Ustawy o Prawach Konsumenta. Dlatego też postanowienia niniejszego Regulaminu nie mają na celu wyłączać ani ograniczać jakichkolwiek praw konsumentów przysługujących im na mocy bezwzględnie wiążących przepisów prawa, a wszelkie ewentualne wątpliwości należy tłumaczyć na korzyść konsumenta. W przypadku ewentualnej niezgodności postanowień niniejszego Regulaminu z powyższymi przepisami, pierwszeństwo mają te przepisy i należy je stosować.</em></p>\n<h1><span style=\"font-size:12pt;color:#000000;\">1. POSTANOWIENIA OGÓLNE</span></h1>\n<p style=\"text-align:justify;\"><span style=\"color:#000000;font-size:10pt;font-family:arial, helvetica, sans-serif;\"><strong>1.1. </strong>Sklep Internetowy dostępny pod adresem internetowym www.numizmatyczny.com prowadzony jest przez Jakuba Starańskiego prowadzącego działalność gospodarczą pod firmą JS Partner Jakub Starański wpisaną do Centralnej Ewidencji i Informacji o Działalności Gospodarczej Rzeczypospolitej Polskiej prowadzonej przez ministra właściwego do spraw gospodarki, posiadającą: adres miejsca wykonywania działalności i adres do doręczeń: ul. Warszawska 26, 40-008 Katowice, NIP 641 241 93 84, REGON 243535017, adres poczty elektronicznej: sklep@numizmatyczny.com, numer telefonu: 502 210 907.</span></p>\n<p style=\"text-align:justify;\"><span style=\"color:#000000;font-size:10pt;font-family:arial, helvetica, sans-serif;\"><strong>1.2.</strong> Niniejszy Regulamin skierowany jest zarówno do konsumentów, jak i do przedsiębiorców korzystających ze Sklepu Internetowego (z wyjątkiem pkt. 9 Regulaminu, który skierowany jest wyłącznie do przedsiębiorców).</span></p>\n<p style=\"text-align:justify;\"><span style=\"color:#000000;font-size:10pt;font-family:arial, helvetica, sans-serif;\"><strong>1.3. </strong>Definicje:</span></p>\n<p style=\"padding-left:30px;text-align:justify;\"><span style=\"color:#000000;font-size:10pt;font-family:arial, helvetica, sans-serif;\"><strong>1.3.1. </strong>DZIEŃ ROBOCZY – jeden dzień od poniedziałku do piątku z wyłączeniem dni ustawowo wolnych od pracy.</span></p>\n<p style=\"padding-left:30px;text-align:justify;\"><span style=\"color:#000000;font-size:10pt;font-family:arial, helvetica, sans-serif;\"><strong>1.3.2. </strong>FORMULARZ REJESTRACJI – formularz dostępny w Sklepie Internetowym umożliwiający utworzenie Konta.</span></p>\n<p style=\"padding-left:30px;text-align:justify;\"><span style=\"color:#000000;font-size:10pt;font-family:arial, helvetica, sans-serif;\"><strong>1.3.3.</strong> FORMULARZ ZAMÓWIENIA – Usługa Elektroniczna, interaktywny formularz dostępny w Sklepie Internetowym umożliwiający złożenie Zamówienia, w szczególności poprzez dodanie Produktów do elektronicznego koszyka oraz określenie warunków Umowy Sprzedaży, w tym sposobu dostawy i płatności.</span></p>\n<p style=\"padding-left:30px;text-align:justify;\"><span style=\"color:#000000;font-size:10pt;font-family:arial, helvetica, sans-serif;\"><strong>1.3.4.</strong> KLIENT:</span></p>\n<p style=\"padding-left:60px;text-align:justify;\"><span style=\"color:#000000;font-size:10pt;font-family:arial, helvetica, sans-serif;\"><strong>1.3.4.1</strong> osoba fizyczna posiadająca pełną zdolność do czynności prawnych, a w wypadkach przewidzianych przez przepisy powszechnie obowiązujące także osoba fizyczna posiadająca ograniczoną zdolność do czynności prawnych, niebędąca konsumentem,</span></p>\n<p style=\"padding-left:60px;text-align:justify;\"><span style=\"color:#000000;font-size:10pt;font-family:arial, helvetica, sans-serif;\"><strong>1.3.4.2</strong> osoba prawna,</span></p>\n<p style=\"padding-left:60px;text-align:justify;\"><span style=\"color:#000000;font-size:10pt;font-family:arial, helvetica, sans-serif;\"><strong>1.3.4.3</strong> jednostka organizacyjna nieposiadająca osobowości prawnej, której ustawa przyznaje zdolność prawną; - która zawarła lub zamierza zawrzeć Umowę Sprzedaży ze Sprzedawcą.</span></p>\n<p style=\"padding-left:30px;text-align:justify;\"><span style=\"color:#000000;font-size:10pt;font-family:arial, helvetica, sans-serif;\"><strong>1.3.5. </strong>KONTO – Usługa Elektroniczna, oznaczony indywidualną nazwą (loginem) i hasłem podanym przez Usługobiorcę zbiór danych w systemie teleinformatycznym Usługodawcy, w którym gromadzone są dane podane przez Usługobiorcę oraz informacje o złożonych przez niego Zamówieniach w Sklepie Internetowym.</span></p>\n<p style=\"padding-left:30px;text-align:justify;\"><span style=\"color:#000000;font-size:10pt;font-family:arial, helvetica, sans-serif;\"><strong>1.3.6. </strong>NEWSLETTER – Usługa Elektroniczna, polegająca na elektronicznej dystrybucji informacji świadczonej przez Usługodawcę za pośrednictwem poczty elektronicznej e-mail, która umożliwia wszystkim korzystającym z niej Usługobiorcom automatyczne otrzymywanie od Usługodawcy cyklicznych treści edycji newslettera zawierających informacje o Produktach, nowościach i promocjach w Sklepie Internetowym.</span></p>\n<p style=\"padding-left:30px;text-align:justify;\"><span style=\"color:#000000;font-size:10pt;font-family:arial, helvetica, sans-serif;\"><strong>1.3.7.</strong> PRODUKT – dostępna w Sklepie Internetowym rzecz ruchoma będąca przedmiotem Umowy Sprzedaży między Klientem a Sprzedawcą.</span></p>\n<p style=\"padding-left:30px;text-align:justify;\"><span style=\"color:#000000;font-size:10pt;font-family:arial, helvetica, sans-serif;\"><strong>1.3.8</strong> REGULAMIN – niniejszy regulamin Sklepu Internetowego.</span></p>\n<p style=\"padding-left:30px;text-align:justify;\"><span style=\"color:#000000;font-size:10pt;font-family:arial, helvetica, sans-serif;\"><strong>1.3.9. </strong>SKLEP INTERNETOWY - sklep internetowy Usługodawcy dostępny pod adresem internetowym: www.numizmatyczny.com </span></p>\n<p style=\"padding-left:30px;text-align:justify;\"><span style=\"color:#000000;font-size:10pt;font-family:arial, helvetica, sans-serif;\"><strong>1.3.10. </strong>SPRZEDAWCA/USŁUGODAWCA – Jakub Starański prowadzący działalność gospodarczą pod firmą JS Partner Jakub Starański wpisaną do Centralnej Ewidencji i Informacji o Działalności Gospodarczej Rzeczypospolitej Polskiej prowadzonej przez ministra właściwego do spraw gospodarki, posiadająca: adres miejsca wykonywania działalności i adres do doręczeń: ul. Warszawska 26, 40-008 Katowice, NIP 641 241 93 84, REGON 243535017, adres poczty elektronicznej: sklep@numizmatyczny.com, numer telefonu: 502 210 907 .</span></p>\n<p style=\"padding-left:30px;text-align:justify;\"><span style=\"color:#000000;font-size:10pt;font-family:arial, helvetica, sans-serif;\"><strong>1.3.11. </strong>UMOWA SPRZEDAŻY – umowa sprzedaży Produktu zawierana albo zawarta między Klientem a Sprzedawcą za pośrednictwem Sklepu Internetowego.</span></p>\n<p style=\"padding-left:30px;text-align:justify;\"><span style=\"color:#000000;font-size:10pt;font-family:arial, helvetica, sans-serif;\"><strong>1.3.12.</strong> USŁUGOBIORCA:</span></p>\n<p style=\"padding-left:60px;text-align:justify;\"><span style=\"color:#000000;font-size:10pt;font-family:arial, helvetica, sans-serif;\"><strong>1.3.12.1</strong> osoba fizyczna posiadająca pełną zdolność do czynności prawnych, a w wypadkach przewidzianych przez przepisy powszechnie obowiązujące także osoba fizyczna posiadająca ograniczoną zdolność do czynności prawnych; </span></p>\n<p style=\"padding-left:60px;text-align:justify;\"><span style=\"color:#000000;font-size:10pt;font-family:arial, helvetica, sans-serif;\"><strong>1.3.12.2</strong> osoba prawna; </span></p>\n<p style=\"padding-left:60px;text-align:justify;\"><span style=\"color:#000000;font-size:10pt;font-family:arial, helvetica, sans-serif;\"><strong>1.3.12.3 </strong>jednostka organizacyjna nieposiadająca osobowości prawnej, której ustawa przyznaje zdolność prawną; - korzystająca lub zamierzająca korzystać z Usługi Elektronicznej.</span></p>\n<p style=\"padding-left:30px;text-align:justify;\"><span style=\"color:#000000;font-size:10pt;font-family:arial, helvetica, sans-serif;\"><strong>1.3.13.</strong> KONSUMENT – osoba fizyczna nieprowadząca działalności gospodarczej zawierająca umowę ze Sprzedawcą, a także, od dnia 1 czerwca 2020 r. osoba fizyczna zawierająca umowę bezpośrednio związaną z jej działalnością gospodarczą, gdy z treści tej umowy wynika, że nie posiada ona dla niej charakteru zawodowego, wynikającego w szczególności z przedmiotu wykonywanej przez nią działalności gospodarczej, udostępnionego na podstawie przepisów o Centralnej Ewidencji i Informacji o Działalności Gospodarczej.</span></p>\n<h1><span style=\"font-size:12pt;\">2. RODZAJE i ZAKRES USŁUG ŚWIADCZONYCH DROGĄ ELEKTRONICZNĄ </span></h1>\n<p style=\"text-align:justify;padding-left:30px;\"><span style=\"color:#000000;font-family:arial, helvetica, sans-serif;font-size:10pt;\"><strong>2.1. </strong> W Sklepie Internetowym dostępne są następujące Usługi Elektroniczne: Konto, Formularz Zamówienia oraz Newsletter.</span></p>\n<p style=\"text-align:justify;padding-left:60px;\"><span style=\"color:#000000;font-family:arial, helvetica, sans-serif;font-size:10pt;\"><strong>2.1.1. </strong> Konto – korzystanie z Konta możliwe jest po wykonaniu łącznie trzech kolejnych kroków przez Usługobiorcę:</span></p>\n<p style=\"text-align:justify;padding-left:90px;\"><span style=\"color:#000000;font-family:arial, helvetica, sans-serif;font-size:10pt;\"><strong>2.1.1.1.</strong> wypełnieniu Formularza Rejestracji, </span></p>\n<p style=\"text-align:justify;padding-left:90px;\"><span style=\"color:#000000;font-family:arial, helvetica, sans-serif;font-size:10pt;\"> <strong>2.1.1.2. </strong>kliknięciu pola „Załóż konto” oraz </span></p>\n<p style=\"text-align:justify;padding-left:90px;\"><span style=\"color:#000000;font-family:arial, helvetica, sans-serif;font-size:10pt;\"><strong>2.1.1.3.</strong> potwierdzeniu chęci utworzenia Konta poprzez kliknięcie w link potwierdzający przesłany automatycznie na podany adres poczty elektronicznej. </span></p>\n<p style=\"text-align:justify;padding-left:90px;\"><span style=\"color:#000000;font-family:arial, helvetica, sans-serif;font-size:10pt;\"><strong>2.1.1.4. </strong>W Formularzu Rejestracji niezbędne jest podanie przez Usługobiorcę następujących danych Usługobiorcy: imię i nazwisko/nazwa firmy, adres (ulica, numer domu/mieszkania, kod pocztowy, miejscowość, kraj), adres poczty elektronicznej, numer telefonu kontaktowego oraz hasło. W wypadku Usługobiorców niebędących konsumentami niezbędne jest także podanie nazwy firmy oraz numeru NIP.</span></p>\n<p style=\"text-align:justify;padding-left:90px;\"><span style=\"color:#000000;font-family:arial, helvetica, sans-serif;font-size:10pt;\"><strong>2.1.1.5.</strong> Usługa Elektroniczna Konto świadczona jest nieodpłatnie przez czas nieoznaczony. Usługobiorca ma możliwość, w każdej chwili i bez podania przyczyny, usunięcia Konta (rezygnacji z Konta) poprzez wysłanie stosownego żądania do Usługodawcy, w szczególności za pośrednictwem poczty elektronicznej na adres: sklep@numizmatyczny.com, pisemnie na adres: ul. Warszawska 26, 40-008 Katowice. Usługobiorca może także usunąć konto samodzielnie.</span></p>\n<p style=\"text-align:justify;padding-left:60px;\"><span style=\"color:#000000;font-family:arial, helvetica, sans-serif;font-size:10pt;\"><strong>2.1.2. </strong> Formularz Zamówienia – korzystanie z Formularza Zamówienia rozpoczyna się z momentem dodania przez Klienta pierwszego Produktu do elektronicznego koszyka w Sklepie Internetowym. Złożenie Zamówienia następuje po wykonaniu przez Klienta łącznie dwóch kolejnych kroków:</span></p>\n<p style=\"text-align:justify;padding-left:90px;\"><span style=\"color:#000000;font-family:arial, helvetica, sans-serif;font-size:10pt;\"><strong>2.1.2.1.</strong> wypełnieniu Formularza Zamówienia,</span></p>\n<p style=\"text-align:justify;padding-left:90px;\"><span style=\"color:#000000;font-family:arial, helvetica, sans-serif;font-size:10pt;\"><strong>2.1.2.2.</strong> kliknięciu na stronie Sklepu Internetowego po wypełnieniu Formularza Zamówienia pola „Potwierdzam zakup” do tego momentu istnieje możliwość samodzielnej modyfikacji wprowadzanych danych (w tym celu należy kierować się wyświetlanymi komunikatami oraz informacjami dostępnymi na stronie Sklepu Internetowego). </span></p>\n<p style=\"text-align:justify;padding-left:90px;\"><span style=\"color:#000000;font-family:arial, helvetica, sans-serif;font-size:10pt;\"><strong>2.1.2.3 </strong>w Formularzu Zamówienia niezbędne jest podanie przez Klienta następujących danych dotyczących Klienta: imię i nazwisko/nazwa firmy, adres (ulica, numer domu/mieszkania, kod pocztowy, miejscowość, kraj), adres poczty elektronicznej, numer telefonu kontaktowego oraz danych dotyczących Umowy Sprzedaży: Produkt/y, ilość Produktu/ów, miejsce i sposób dostawy Produktu/ów, sposób płatności. W wypadku Klientów niebędących konsumentami niezbędne jest także podanie nazwy firmy oraz numeru NIP.</span></p>\n<p style=\"text-align:justify;padding-left:90px;\"><span style=\"color:#000000;font-family:arial, helvetica, sans-serif;font-size:10pt;\"><strong>2.1.2.4. </strong> Usługa Elektroniczna Formularz Zamówienia świadczona jest nieodpłatnie oraz ma charakter jednorazowy i ulega zakończeniu z chwilą złożenia Zamówienia za jego pośrednictwem albo z chwilą wcześniejszego zaprzestania składania Zamówienia za jego pośrednictwem przez Usługobiorcę.</span></p>\n<p style=\"text-align:justify;padding-left:60px;\"><span style=\"color:#000000;font-family:arial, helvetica, sans-serif;font-size:10pt;\"><strong>2.1.3. </strong> Newsletter – rozpoczęcie korzystania z Newslettera następuje po podaniu w zakładce „Newsletter” widocznej na stronie Sklepu Internetowego adresu poczty elektronicznej, na który mają być przesyłane kolejne edycje Newslettera i kliknięciu pola z ikoną koperty. Na Newsletter można się również zapisać poprzez zaznaczenie odpowiedniego checkboxa w trakcie zakładania Konta – z chwilą utworzenia Konta Usługobiorca zostaje zapisany na Newsletter.</span></p>\n<p style=\"text-align:justify;padding-left:90px;\"><span style=\"color:#000000;font-family:arial, helvetica, sans-serif;font-size:10pt;\"><strong>2.1.3.1. </strong> Usługa Elektroniczna Newsletter świadczona jest nieodpłatnie przez czas nieoznaczony. Usługobiorca ma możliwość, w każdej chwili i bez podania przyczyny rezygnacji z Newslettera poprzez wysłanie stosownego żądania do Usługodawcy, w szczególności za pośrednictwem linku rezygnacyjnego znajdującego się w każdej wiadomości Newslettera, poczty elektronicznej na adres: sklep@numizmatyczny.com lub też pisemnie na adres: ul. Warszawska 26, 40-008 Katowice.</span></p>\n<p style=\"text-align:justify;padding-left:30px;\"><span style=\"color:#000000;font-family:arial, helvetica, sans-serif;font-size:10pt;\"><strong>2.2.</strong> Wymagania techniczne niezbędne do współpracy z systemem teleinformatycznym, którym posługuje się Usługodawca w celu korzystania z Usług Elektronicznych: komputer, laptop lub inne urządzenie multimedialne z dostępem do Internetu, dostęp do poczty elektronicznej, przeglądarka internetowa: Mozilla Firefox w wersji 11.0 i wyższej lub Internet Explorer w wersji 7.0 i wyższej, Opera w wersji 7.0 i wyższej, Google Chrome w wersji 12.0.0 i wyższej, zalecana minimalna rozdzielczość ekranu: 1024x768, włączenie w przeglądarce internetowej możliwości obsługi Javascript.</span></p>\n<p style=\"text-align:justify;padding-left:30px;\"><span style=\"color:#000000;font-family:arial, helvetica, sans-serif;font-size:10pt;\"><strong>2.3. </strong>Usługobiorca obowiązany jest do korzystania ze Sklepu Internetowego w sposób zgodny z prawem i dobrymi obyczajami mając na uwadze poszanowanie dóbr osobistych oraz praw autorskich i własności intelektualnej Usługodawcy oraz osób trzecich. Usługobiorca obowiązany jest do wprowadzania danych zgodnych ze stanem faktycznym. Usługobiorcę obowiązuje zakaz dostarczania treści o charakterze bezprawnym.</span></p>\n<p style=\"text-align:justify;padding-left:30px;\"><span style=\"color:#000000;font-family:arial, helvetica, sans-serif;font-size:10pt;\"><strong>2.4. Postępowanie reklamacyjne:</strong></span></p>\n<p style=\"text-align:justify;padding-left:60px;\"><span style=\"color:#000000;font-family:arial, helvetica, sans-serif;font-size:10pt;\"><strong>2.4.1. </strong> Reklamacje dotyczące Usług Elektronicznych oraz pozostałe reklamacje związanie z działaniem Sklepu Internetowego (nie dot. reklamacji Produktu, zasady tego rodzaju reklamacji zostały określone w pkt. 6 Regulaminu) Usługobiorca może składać na przykład:</span></p>\n<p style=\"text-align:justify;padding-left:90px;\"><span style=\"color:#000000;font-family:arial, helvetica, sans-serif;font-size:10pt;\"><strong>2.4.1.1. </strong>pisemnie na adres: ul. Warszawska 26, 40-008 Katowice;</span></p>\n<p style=\"text-align:justify;padding-left:90px;\"><span style=\"color:#000000;font-family:arial, helvetica, sans-serif;font-size:10pt;\"><strong>2.4.1.1. . </strong> w formie elektronicznej za pośrednictwem poczty elektronicznej na adres: sklep@numizmatyczny.com;</span></p>\n<p style=\"text-align:justify;padding-left:60px;\"><span style=\"color:#000000;font-family:arial, helvetica, sans-serif;font-size:10pt;\"><strong>2.4.2.</strong> Zaleca się podanie przez Usługobiorcę w opisie reklamacji: </span></p>\n<p style=\"text-align:justify;padding-left:90px;\"><span style=\"color:#000000;font-family:arial, helvetica, sans-serif;font-size:10pt;\"><strong>2.4.2.1. </strong>informacji i okoliczności dotyczących przedmiotu reklamacji, w szczególności rodzaju i daty wystąpienia nieprawidłowości; </span></p>\n<p style=\"text-align:justify;padding-left:90px;\"><span style=\"color:#000000;font-family:arial, helvetica, sans-serif;font-size:10pt;\"><strong>2.4.2.2.</strong> żądania Usługobiorcy; </span></p>\n<p style=\"text-align:justify;padding-left:90px;\"><span style=\"color:#000000;font-family:arial, helvetica, sans-serif;font-size:10pt;\"><strong>2.4.2.3. </strong>danych kontaktowych składającego reklamację – przyspieszy to i ułatwi rozpatrywanie reklamacji przez Usługodawcę. Wskazane wymogi mają formę jedynie zalecenia i nie wpływają na skuteczność reklamacji złożonych z pominięciem zalecanego opisu reklamacji.</span></p>\n<p style=\"text-align:justify;padding-left:90px;\"><span style=\"color:#000000;font-family:arial, helvetica, sans-serif;font-size:10pt;\"><strong>2.4.2.4. </strong>Ustosunkowanie się do reklamacji przez Usługodawcę następuje niezwłocznie, nie później niż w terminie 14 dni kalendarzowych od dnia jej złożenia.</span></p>\n<h1><span style=\"font-size:12pt;\">3. WARUNKI ZAWIERANIA I WYPOWIADANIA UMOWY SPRZEDAŻY</span></h1>\n<p style=\"padding-left:30px;text-align:justify;\"><span style=\"font-family:arial, helvetica, sans-serif;color:#000000;font-size:10pt;\"><strong>3.1. </strong> Zawarcie Umowy Sprzedaży między Klientem, a Sprzedawcą następuje po uprzednim złożeniu przez Klienta Zamówienia za pomocą Formularza Zamówień w Sklepie Internetowym zgodnie z pkt. 2.1.2 Regulaminu.</span></p>\n<p style=\"padding-left:30px;text-align:justify;\"><span style=\"font-family:arial, helvetica, sans-serif;color:#000000;font-size:10pt;\"><strong>3.2.</strong> Cena Produktu widoczna na stronie Sklepu Internetowego podana jest w złotych polskich i zawiera podatki. O cenie łącznej wraz z podatkami Produktu który jest przedmiotem Zamówienia, a także o kosztach dostawy (w tym opłatach za transport, dostarczenie i usługi pocztowe) oraz o innych kosztach, a gdy nie można ustalić wysokości tych opłat – o obowiązku ich uiszczenia, Klient jest informowany na stronach Sklepu Internetowego w trakcie składania Zamówienia, w tym także w chwili wyrażenia przez Klienta woli związania się Umową Sprzedaży.</span></p>\n<p style=\"padding-left:30px;text-align:justify;\"><span style=\"font-family:arial, helvetica, sans-serif;color:#000000;font-size:10pt;\"><strong>3.3.</strong> Zawarcie Umowy Sprzedaży w Sklepie Internetowym następuje za pomocą Formularza Zamówień.</span></p>\n<p style=\"padding-left:30px;text-align:justify;\"><span style=\"font-family:arial, helvetica, sans-serif;color:#000000;font-size:10pt;\"><strong>3.4.</strong> Zawarcie Umowy Sprzedaży między Klientem, a Sprzedawcą następuje po uprzednim złożeniu przez Klienta Zamówienia w Sklepie Internetowym zgodnie z pkt. 2.1.2 Regulaminu.</span></p>\n<p style=\"padding-left:30px;text-align:justify;\"><span style=\"font-family:arial, helvetica, sans-serif;color:#000000;font-size:10pt;\"><strong>3.5.</strong> Po złożeniu Zamówienia Sprzedawca niezwłocznie potwierdza jego otrzymanie oraz jednocześnie przyjmuje Zamówienie do realizacji. Potwierdzenie otrzymania Zamówienia i jego przyjęcie do realizacji następuje poprzez przesłanie przez Sprzedawcę Klientowi stosownej wiadomości e-mail na podany w trakcie składania Zamówienia adres poczty elektronicznej Klienta, która zawiera co najmniej oświadczenia Sprzedawcy o otrzymaniu Zamówienia i o jego przyjęciu do realizacji oraz potwierdzenie zawarcia Umowy Sprzedaży. Z chwilą otrzymania przez Klienta powyższej wiadomości e-mail zostaje zawarta Umowa Sprzedaży między Klientem, a Sprzedawcą.</span></p>\n<p style=\"padding-left:30px;text-align:justify;\"><span style=\"font-family:arial, helvetica, sans-serif;color:#000000;font-size:10pt;\"><strong>3.6.</strong> Utrwalenie, zabezpieczenie oraz udostępnienie Klientowi treści zawieranej Umowy Sprzedaży następuje poprzez udostępnienie niniejszego Regulaminu na stronie Sklepu Internetowego oraz przesłanie Klientowi wiadomości e-mail, o której mowa w pkt. 3.5 Regulaminu. Treść Umowy Sprzedaży jest dodatkowo utrwalona i zabezpieczona w systemie informatycznym Sklepu Internetowego Sprzedawcy.</span></p>\n<h1><span style=\"font-size:12pt;\">4. ODSTĄPIENIE OD UMOWY</span></h1>\n<p style=\"padding-left:30px;text-align:justify;\"><span style=\"font-size:10pt;color:#000000;font-family:arial, helvetica, sans-serif;\"><strong>4.1. </strong>Konsument, może w terminie 14 dni kalendarzowych odstąpić od umowy zawartej na odległość bez podawania przyczyny i bez ponoszenia kosztów, z wyjątkiem kosztów określonych w pkt. 4.7 Regulaminu. Do zachowania terminu wystarczy wysłanie oświadczenia przed jego upływem. Oświadczenie o odstąpieniu od umowy może zostać złożone na przykład:</span></p>\n<p style=\"padding-left:60px;text-align:justify;\"><span style=\"font-size:10pt;color:#000000;font-family:arial, helvetica, sans-serif;\"><strong>4.1.1. </strong>pisemnie na adres: ul. Warszawska 26, 40-008 Katowice;</span></p>\n<p style=\"padding-left:60px;text-align:justify;\"><span style=\"font-size:10pt;color:#000000;font-family:arial, helvetica, sans-serif;\"><strong>4.1.2. </strong>w formie elektronicznej za pośrednictwem poczty elektronicznej na adres: <a style=\"color:#000000;\" href=\"mailto:sklep@numizmatyczny.com\">sklep@numizmatyczny.com</a>;</span></p>\n<p style=\"padding-left:60px;text-align:justify;\"><span style=\"color:#000000;font-family:arial, helvetica, sans-serif;font-size:10pt;\"><strong>4.1.2. </strong>Wzór formularza odstąpienia od umowy znajduje się na końcu tego artykułu. Wzór formularza to załącznik nr 2 do Ustawy o Prawach Konsumenta. Konsument może skorzystać z wzoru formularza, jednak nie jest to obowiązkowe.</span></p>\n<p style=\"padding-left:30px;text-align:justify;\"><span style=\"color:#000000;font-family:arial, helvetica, sans-serif;font-size:10pt;\"><strong>4.2. </strong>Bieg terminu do odstąpienia od umowy rozpoczyna się:</span></p>\n<p style=\"padding-left:60px;text-align:justify;\"><span style=\"color:#000000;font-family:arial, helvetica, sans-serif;font-size:10pt;\"><strong>4.2.1. </strong>dla umowy, w wykonaniu której Sprzedawca wydaje Produkt, będąc zobowiązany do przeniesienia jego własności (np. Umowa Sprzedaży) – od objęcia Produktu w posiadanie przez konsumenta lub wskazaną przez niego osobę trzecią inną niż przewoźnik, a w przypadku umowy, która: (1) obejmuje wiele Produktów, które są dostarczane osobno, partiami lub w częściach – od objęcia w posiadanie ostatniego Produktu, partii lub części albo (2) polega na regularnym dostarczaniu Produktów przez czas oznaczony – od objęcia w posiadanie pierwszego z Produktów,</span></p>\n<p style=\"padding-left:60px;text-align:justify;\"><span style=\"color:#000000;font-family:arial, helvetica, sans-serif;font-size:10pt;\"><strong>4.2.2. </strong>dla pozostałych umów – od dnia zawarcia umowy.</span></p>\n<p style=\"padding-left:30px;text-align:justify;\"><span style=\"color:#000000;font-family:arial, helvetica, sans-serif;font-size:10pt;\"><strong>4.3. </strong>Odstąpienie od umowy powoduje, że umowę uważa się za niezawartą.</span></p>\n<p style=\"padding-left:30px;text-align:justify;\"><span style=\"color:#000000;font-family:arial, helvetica, sans-serif;font-size:10pt;\"><strong>4.4. </strong>Sprzedawca niezwłocznie, nie później niż w terminie 14 dni kalendarzowych od dnia otrzymania oświadczenia Konsumenta o odstąpieniu od umowy, zwróci wszystkie dokonane przez niego płatności, w tym koszty dostawy Produktu (z wyjątkiem dodatkowych kosztów wynikających z wybranego przez Klienta sposobu dostawy innego niż najtańszy zwykły sposób dostawy dostępny w Sklepie Internetowym). Sprzedawca dokonuje zwrotu płatności przy użyciu takiego samego sposobu płatności, jakiego użył Konsument, chyba że tenże Konsument wyraźnie zgodził się na inny sposób zwrotu, który nie wiąże się dla niego z żadnymi kosztami. Jeżeli Sprzedawca nie zaproponował, że sam odbierze Produkt od konsumenta, może wstrzymać się ze zwrotem płatności otrzymanych od konsumenta do chwili otrzymania Produktu z powrotem lub dostarczenia przez konsumenta dowodu jego odesłania, w zależności od tego, które zdarzenie nastąpi wcześniej.</span></p>\n<p style=\"padding-left:30px;text-align:justify;\"><span style=\"color:#000000;font-family:arial, helvetica, sans-serif;font-size:10pt;\"><strong>4.5. </strong>Konsument ma obowiązek niezwłocznie, nie później niż w terminie 14 dni kalendarzowych od dnia, w którym odstąpił od umowy, zwrócić Produkt Sprzedawcy lub przekazać go osobie upoważnionej przez Sprzedawcę do odbioru, chyba że Sprzedawca zaproponował, że sam odbierze Produkt. Do zachowania terminu wystarczy odesłanie Produktu przed jego upływem. Konsument może zwrócić Produkt na adres: ul. Warszawska 26, 40-008 Katowice.</span></p>\n<p style=\"padding-left:30px;text-align:justify;\"><span style=\"color:#000000;font-family:arial, helvetica, sans-serif;font-size:10pt;\"><strong>4.6. </strong>Konsument ponosi odpowiedzialność za zmniejszenie wartości Produktu będące wynikiem korzystania z niego w sposób wykraczający poza konieczny do stwierdzenia charakteru, cech i funkcjonowania Produktu.</span></p>\n<p style=\"padding-left:30px;text-align:justify;\"><span style=\"color:#000000;font-family:arial, helvetica, sans-serif;font-size:10pt;\"><strong>4.7. </strong>Możliwe koszty związane z odstąpieniem przez Konsumenta od umowy, które obowiązany jest ponieść Konsument:</span></p>\n<p style=\"padding-left:60px;text-align:justify;\"><span style=\"color:#000000;font-family:arial, helvetica, sans-serif;font-size:10pt;\"><strong>4.7.1. </strong>Jeżeli Konsument wybrał sposób dostawy Produktu inny niż najtańszy zwykły sposób dostawy dostępny w Sklepie Internetowym, Sprzedawca nie jest zobowiązany do zwrotu konsumentowi poniesionych przez niego dodatkowych kosztów.</span></p>\n<p style=\"padding-left:60px;text-align:justify;\"><span style=\"color:#000000;font-family:arial, helvetica, sans-serif;font-size:10pt;\"><strong>4.7.2. </strong>Konsument ponosi bezpośrednie koszty zwrotu Produktu.</span></p>\n<p style=\"padding-left:60px;text-align:justify;\"><span style=\"color:#000000;font-family:arial, helvetica, sans-serif;font-size:10pt;\"><strong>4.7.3. </strong>W przypadku Produktu będącego usługą, której wykonywanie - na wyraźne żądanie konsumenta - rozpoczęło się przed upływem terminu do odstąpienia od umowy, konsument, który wykonuje prawo odstąpienia od umowy po zgłoszeniu takiego żądania, ma obowiązek zapłaty za świadczenia spełnione do chwili odstąpienia od umowy. Kwotę zapłaty oblicza się proporcjonalnie do zakresu spełnionego świadczenia, z uwzględnieniem uzgodnionej w umowie ceny lub wynagrodzenia. Jeżeli cena lub wynagrodzenie są nadmierne, podstawą obliczenia tej kwoty jest wartość rynkowa spełnionego świadczenia.</span></p>\n<p style=\"padding-left:30px;text-align:justify;\"><span style=\"color:#000000;font-family:arial, helvetica, sans-serif;font-size:10pt;\"><strong>4.8. </strong>Prawo odstąpienia od umowy zawartej na odległość nie przysługuje Konsumentowi w odniesieniu do umów:</span></p>\n<p style=\"padding-left:60px;text-align:justify;\"><span style=\"color:#000000;font-family:arial, helvetica, sans-serif;font-size:10pt;\"><strong>4.8.1. </strong>o świadczenie usług, jeżeli Sprzedawca wykonał w pełni usługę za wyraźną zgodą Konsumenta, który został poinformowany przed rozpoczęciem świadczenia, że po spełnieniu świadczenia przez Sprzedawcę utraci prawo odstąpienia od umowy,</span></p>\n<p style=\"padding-left:60px;text-align:justify;\"><span style=\"color:#000000;font-family:arial, helvetica, sans-serif;font-size:10pt;\"><strong>4.8.2. </strong>w której cena lub wynagrodzenie zależy od wahań na rynku finansowym, nad którymi Sprzedawca nie sprawuje kontroli, i które mogą wystąpić przed upływem terminu do odstąpienia od umowy,</span></p>\n<p style=\"padding-left:60px;text-align:justify;\"><span style=\"color:#000000;font-family:arial, helvetica, sans-serif;font-size:10pt;\"><strong>4.8.3. </strong>w której przedmiotem świadczenia jest Produkt nieprefabrykowany, wyprodukowany według specyfikacji konsumenta lub służący zaspokojeniu jego zindywidualizowanych potrzeb,</span></p>\n<p style=\"padding-left:60px;text-align:justify;\"><span style=\"color:#000000;font-family:arial, helvetica, sans-serif;font-size:10pt;\"><strong>4.8.4. </strong>w której przedmiotem świadczenia jest Produkt ulegający szybkiemu zepsuciu lub mająca krótki termin przydatności do użycia,</span></p>\n<p style=\"padding-left:60px;text-align:justify;\"><span style=\"color:#000000;font-family:arial, helvetica, sans-serif;font-size:10pt;\"><strong>4.8.5. </strong>w której przedmiotem świadczenia jest Produkt dostarczany w zapieczętowanym opakowaniu, którego po otwarciu opakowania nie można zwrócić ze względu na ochronę zdrowia lub ze względów higienicznych, jeżeli opakowanie zostało otwarte po dostarczeniu,</span></p>\n<p style=\"padding-left:60px;text-align:justify;\"><span style=\"color:#000000;font-family:arial, helvetica, sans-serif;font-size:10pt;\"><strong>4.8.6. </strong>w której przedmiotem świadczenia są Produkty, które po dostarczeniu, ze względu na swój charakter, zostają nierozłącznie połączone z innymi rzeczami,</span></p>\n<p style=\"padding-left:60px;text-align:justify;\"><span style=\"color:#000000;font-family:arial, helvetica, sans-serif;font-size:10pt;\"><strong>4.8.7. </strong>w której przedmiotem świadczenia są napoje alkoholowe, których cena została uzgodniona przy zawarciu Umowy Sprzedaży, a których dostarczenie może nastąpić dopiero po upływie 30 dni i których wartość zależy od wahań na rynku, nad którymi Sprzedawca nie ma kontroli,</span></p>\n<p style=\"padding-left:60px;text-align:justify;\"><span style=\"color:#000000;font-family:arial, helvetica, sans-serif;font-size:10pt;\"><strong>4.8.8. </strong>w której Konsument wyraźnie żądał, aby Sprzedawca do niego przyjechał w celu dokonania pilnej naprawy lub konserwacji; jeżeli Sprzedawca świadczy dodatkowo inne usługi niż te, których wykonania konsument żądał, lub dostarcza Produkty inne niż części zamienne niezbędne do wykonania naprawy lub konserwacji, prawo odstąpienia od umowy przysługuje konsumentowi w odniesieniu do dodatkowych usług lub Produktów,</span></p>\n<p style=\"padding-left:60px;text-align:justify;\"><span style=\"color:#000000;font-family:arial, helvetica, sans-serif;font-size:10pt;\"><strong>4.8.9. </strong>w której przedmiotem świadczenia są nagrania dźwiękowe lub wizualne albo programy komputerowe dostarczane w zapieczętowanym opakowaniu, jeżeli opakowanie zostało otwarte po dostarczeniu,</span></p>\n<p style=\"padding-left:60px;text-align:justify;\"><span style=\"color:#000000;font-family:arial, helvetica, sans-serif;font-size:10pt;\"><strong>4.8.10. </strong>o dostarczanie dzienników, periodyków lub czasopism, z wyjątkiem umowy o prenumeratę,</span></p>\n<p style=\"padding-left:60px;text-align:justify;\"><span style=\"color:#000000;font-family:arial, helvetica, sans-serif;font-size:10pt;\"><strong>4.8.11. </strong>zawartej w drodze aukcji publicznej,</span></p>\n<p style=\"padding-left:60px;text-align:justify;\"><span style=\"color:#000000;font-family:arial, helvetica, sans-serif;font-size:10pt;\"><strong>4.8.12. </strong>o świadczenie usług w zakresie zakwaterowania, innych niż do celów mieszkalnych, przewozu rzeczy, najmu samochodów, gastronomii, usług związanych z wypoczynkiem, wydarzeniami rozrywkowymi, sportowymi lub kulturalnymi, jeżeli w umowie oznaczono dzień lub okres świadczenia usługi,</span></p>\n<p style=\"padding-left:60px;text-align:justify;\"><span style=\"color:#000000;font-family:arial, helvetica, sans-serif;font-size:10pt;\"><strong>4.8.13. </strong>o dostarczanie treści cyfrowych, które nie są zapisane na nośniku materialnym, jeżeli spełnianie świadczenia rozpoczęło się za wyraźną zgodą konsumenta przed upływem terminu do odstąpienia od umowy i po poinformowaniu go przez Sprzedawcę o utracie prawa odstąpienia od umowy.</span></p>\n<h1><span style=\"font-size:12pt;\">5. SPOSOBY I TERMINY PŁATNOŚCI ZA PRODUKT</span></h1>\n<p style=\"text-align:justify;padding-left:30px;\"><span style=\"color:#000000;font-size:10pt;font-family:arial, helvetica, sans-serif;\"><strong>5.1.</strong> Sprzedawca udostępnia następujące sposoby płatności należności z tytułu Umowy Sprzedaży:</span></p>\n<p style=\"padding-left:60px;text-align:justify;\"><span style=\"color:#000000;font-size:10pt;font-family:arial, helvetica, sans-serif;\"><strong>5.1.1.</strong> Płatność za pobraniem przy odbiorze przesyłki.</span></p>\n<p style=\"padding-left:60px;text-align:justify;\"><span style=\"color:#000000;font-size:10pt;font-family:arial, helvetica, sans-serif;\"><strong>5.1.2.</strong> Płatność gotówką przy odbiorze osobistym.</span></p>\n<p style=\"padding-left:60px;text-align:justify;\"><span style=\"color:#000000;font-size:10pt;font-family:arial, helvetica, sans-serif;\"><strong>5.1.3.</strong> Płatność przelewem na rachunek bankowy Sprzedawcy: Bank PKO BP<strong>.</strong> Numer rachunku: 54 1020 2401 0000 0002 0462 2512.</span></p>\n<p style=\"padding-left:60px;text-align:justify;\"><span style=\"font-size:10pt;color:#000000;font-family:arial, helvetica, sans-serif;\"><strong>5.1.4.</strong> Płatność za pośrednictwem serwisu PayU : <a style=\"color:#000000;\" href=\"https://www.payu.pl/\" target=\"_blank\" rel=\"noreferrer noopener\">https://www.payu.pl/</a></span></p>\n<p style=\"padding-left:60px;text-align:justify;\"><span style=\"color:#000000;font-size:10pt;font-family:arial, helvetica, sans-serif;\"><strong>5.1.5.</strong> Płatności elektroniczne i płatności kartą płatniczą. Możliwe aktualne sposoby płatności online określone są na stronie Sklepu Internetowego <a style=\"color:#000000;\" title=\"numizmatyczny.com\" href=\"/numizmatyczny.com\">numizmatyczny.com</a> w zakładce „Sposoby płatności” </span></p>\n<p style=\"padding-left:90px;text-align:justify;\"><span style=\"color:#000000;font-size:10pt;font-family:arial, helvetica, sans-serif;\"><strong>5.1.5.1.</strong> Rozliczenia transakcji płatnościami elektronicznymi i kartą płatniczą przeprowadzane są zgodnie z wyborem Klienta za pośrednictwem podmiotu świadczącego obsługę płatności online drogą elektroniczną  Autopay S.A. (<a style=\"color:#000000;\" href=\"https://autopay.pl/\" target=\"_blank\" rel=\"noreferrer noopener\">autopay.pl</a>)</span></p>\n<p style=\"padding-left:120px;text-align:justify;\"><span style=\"font-size:10pt;color:#000000;font-family:arial, helvetica, sans-serif;\"><strong>5.1.5.1.1.</strong> Autopay S.A. z siedzibą w Sopocie przy ulicy Powstańców Warszawy 6, kod 81-718.</span><br /><span style=\"font-size:10pt;color:#000000;font-family:arial, helvetica, sans-serif;\">Spółka została zarejestrowana w Sądzie Rejonowym Gdańsk-Północ VIII Wydział Gospodarczy KRS pod nr 0000320590, NIP 585-13-51-185, REGON 191781561. Kapitał zakładowy 2 000 000 złotych (wpłacony w całości).</span></p>\n<p style=\"padding-left:90px;text-align:justify;\"><span style=\"color:#000000;font-size:10pt;font-family:arial, helvetica, sans-serif;\"><strong>5.1.5.2.</strong> Karty płatnicze, którymi można realizować płatność: Visa; Visa Electron; MasterCard; MasterCard Electronic; Maestro</span></p>\n<p style=\"padding-left:90px;text-align:justify;\"><span style=\"font-size:10pt;color:#000000;font-family:arial, helvetica, sans-serif;\"><strong>5.1.5.3.</strong> W przypadku wystąpienia konieczność zwrotu środków za transakcję dokonaną przez klienta kartą płatniczą, sprzedający dokona zwrotu na rachunek bankowy podany za pośrednictwem poczty elektronicznej przez Zamawiającego.</span></p>\n<p style=\"text-align:justify;padding-left:30px;\"><span style=\"color:#000000;font-size:10pt;font-family:arial, helvetica, sans-serif;\"> <strong>5.2. </strong>Termin płatności:</span></p>\n<p style=\"padding-left:60px;text-align:justify;\"><span style=\"color:#000000;font-size:10pt;font-family:arial, helvetica, sans-serif;\"><strong>5.2.1.</strong> 5.5.1. W przypadku wyboru przez Klienta płatności gotówką przy odbiorze osobistym, płatności przelewem, płatności elektronicznych albo płatności kartą płatniczą, Klient obowiązany jest do dokonania płatności w terminie 5 dni kalendarzowych od dnia zawarcia Umowy Sprzedaży. Po upływie 5 dni w przypadku braku płatności zamówienie zostaje anulowane, a Sprzedawcy przysługuje prawo odstąpienia od umowy. </span></p>\n<p style=\"padding-left:60px;text-align:justify;\"><span style=\"color:#000000;font-size:10pt;font-family:arial, helvetica, sans-serif;\"><strong>5.2.2.</strong> W przypadku wyboru przez Klienta płatności za pobraniem przy odbiorze przesyłki, Klient obowiązany jest do dokonania płatności przy odbiorze przesyłki.</span></p>\n<h1><span style=\"font-size:12pt;\">6. KOSZT, SPOSOBY I TERMIN DOSTAWY ORAZ ODBIORU PRODUKTU</span></h1>\n<p style=\"text-align:justify;padding-left:30px;\"><span style=\"color:#000000;font-family:arial, helvetica, sans-serif;font-size:10pt;\"><strong>6.1.</strong> Dostawa Produktu dostępna jest na terytorium Rzeczypospolitej Polskiej oraz na terenie Unii Europejskiej.</span></p>\n<p style=\"text-align:justify;padding-left:30px;\"><span style=\"color:#000000;font-family:arial, helvetica, sans-serif;font-size:10pt;\"><strong>6.2.</strong> Dostawa Produktu do Klienta jest odpłatna, chyba że Umowa Sprzedaży stanowi inaczej. O kosztach dostawy Produktu (w tym opłaty za transport, dostarczenie i usługi pocztowe) Klient informowany jest na stronach Sklepu Internetowego w zakładce „Koszty dostawy” oraz w trakcie składania Zamówienia, w tym także w chwili wyrażenia przez Klienta woli związania się Umową Sprzedaży.</span></p>\n<p style=\"text-align:justify;padding-left:30px;\"><span style=\"color:#000000;font-family:arial, helvetica, sans-serif;font-size:10pt;\"><strong>6.3.</strong> Odbiór osobisty Produktu przez Klienta jest bezpłatny.</span></p>\n<p style=\"text-align:justify;padding-left:30px;\"><span style=\"font-size:10pt;font-family:arial, helvetica, sans-serif;color:#000000;\"><strong>6.4. </strong>Odbiór osobisty dostępny pod adresem: Warszawska 26, Katowice (40 – 008) – w Dni Robocze, po wcześniejszym umówieniu godziny po numerem telefonu: 502 210 907.</span></p>\n<p style=\"text-align:justify;padding-left:30px;\"><span style=\"color:#000000;font-family:arial, helvetica, sans-serif;font-size:10pt;\"><strong>6.5.</strong> Sprzedawca udostępnia Klientowi następujące sposoby dostawy lub odbioru Produktu:</span></p>\n<p style=\"padding-left:60px;text-align:justify;\"><span style=\"color:#000000;font-family:arial, helvetica, sans-serif;font-size:10pt;\"><strong>6.5.1.</strong> <label>Paczka Poczty Polskiej - Kurier</label></span></p>\n<p style=\"padding-left:60px;text-align:justify;\"><span style=\"color:#000000;font-family:arial, helvetica, sans-serif;font-size:10pt;\"><strong>6.5.2.</strong> Paczkomaty InPost.</span></p>\n<p style=\"padding-left:60px;text-align:justify;\"><span style=\"color:#000000;font-family:arial, helvetica, sans-serif;font-size:10pt;\"><strong>6.5.3</strong>. Kurier InPost</span></p>\n<p style=\"padding-left:60px;text-align:justify;\"><span style=\"color:#000000;font-family:arial, helvetica, sans-serif;font-size:10pt;\"><strong>6.5.4</strong>. Kurier UPS</span></p>\n<p style=\"padding-left:60px;text-align:justify;\"><span style=\"color:#000000;font-family:arial, helvetica, sans-serif;font-size:10pt;\"><strong>6.5.5.</strong> <label>Wysyłka Międzynarodowa - Kurier UPS</label> <span class=\"description\">International</span></span></p>\n<p style=\"padding-left:60px;text-align:justify;\"><span style=\"color:#000000;font-family:arial, helvetica, sans-serif;font-size:10pt;\"><strong>6.5.6. </strong> <label>odbiór osobisty w Katowicach</label></span></p>\n<p style=\"text-align:justify;padding-left:30px;\"><span style=\"color:#000000;font-family:arial, helvetica, sans-serif;font-size:10pt;\"><strong>6.6.</strong> Termin dostawy Produktu do Klienta wynosi do 7 Dni Roboczych, chyba że w opisie danego Produktu lub w trakcie składania Zamówienia wynika krótszy termin. W przypadku Produktów o różnych terminach dostawy, wiążącym terminem dostawy jest najdłuższy podany termin, ale nie dłuższy niż 7 Dni Roboczych. Początek biegu terminu dostawy Produktu do Klienta liczy się w następujący sposób:</span></p>\n<p style=\"padding-left:60px;text-align:justify;\"><span style=\"color:#000000;font-family:arial, helvetica, sans-serif;font-size:10pt;\"><strong>6.6.1. </strong> W przypadku wyboru przez Klienta sposobu płatności przelewem, płatności elektroniczne lub kartą płatniczą - od dnia uznania rachunku bankowego lub konta rozliczeniowego Sprzedawcy.</span></p>\n<p style=\"padding-left:60px;text-align:justify;\"><span style=\"color:#000000;font-family:arial, helvetica, sans-serif;font-size:10pt;\"><strong>6.6.2.</strong> W przypadku wyboru przez Klienta sposobu płatności za pobraniem – od dnia zawarcia Umowy Sprzedaży.</span></p>\n<p style=\"text-align:justify;padding-left:30px;\"><span style=\"color:#000000;font-family:arial, helvetica, sans-serif;font-size:10pt;\"><strong>6.7.</strong> Termin gotowości Produktu do odbioru przez Klienta – w przypadku wyboru przez Klienta odbioru osobistego Produktu, Produkt będzie gotowy do odbioru przez Klienta w terminie do 7 Dni Roboczych, chyba że w opisie danego Produktu lub w trakcie składania Zamówienia podano krótszy termin. W przypadku Produktów o różnych terminach gotowości do odbioru, terminem gotowości do odbioru jest najdłuższy podany termin. O gotowości Produktu do odbioru Klient zostanie dodatkowo poinformowany przez Sprzedawcę poprzez przesłanie stosownej wiadomości e-mail na podany w trakcie składania Zamówienia adres poczty elektronicznej Klienta. Początek biegu terminu gotowości Produktu do odbioru przez Klienta liczy się w następujący sposób:</span></p>\n<p style=\"padding-left:60px;text-align:justify;\"><span style=\"color:#000000;font-family:arial, helvetica, sans-serif;font-size:10pt;\"><strong>6.7.1.</strong> W przypadku wyboru przez Klienta sposobu płatności przelewem, płatności elektroniczne lub kartą płatniczą - od dnia uznania rachunku bankowego lub konta rozliczeniowego Sprzedawcy.</span></p>\n<p style=\"padding-left:60px;text-align:justify;\"><span style=\"color:#000000;font-family:arial, helvetica, sans-serif;font-size:10pt;\"><strong>6.7.2.</strong> W przypadku wyboru przez Klienta sposobu gotówką przy odbiorze osobistym – od dnia zawarcia Umowy Sprzedaży.</span></p>\n<h1><span style=\"font-size:12pt;\">7. REKLAMACJA PRODUKTU</span></h1>\n<p style=\"text-align:justify;padding-left:30px;\"><span style=\"font-family:arial, helvetica, sans-serif;color:#000000;font-size:10pt;\"><strong>7.1.</strong> Reklamacja może zostać złożona przez Klienta:</span></p>\n<p style=\"padding-left:60px;text-align:justify;\"><span style=\"font-family:arial, helvetica, sans-serif;color:#000000;font-size:10pt;\"><strong>7.1.1. </strong>pisemnie na adres: ul. Warszawska 26, 40-008 Katowice.</span></p>\n<p style=\"padding-left:60px;text-align:justify;\"><span style=\"font-family:arial, helvetica, sans-serif;color:#000000;font-size:10pt;\"><strong>7.1.2.  </strong>w formie elektronicznej za pośrednictwem poczty elektronicznej na adres: <a style=\"color:#000000;\" href=\"mailto:sklep@numizmatyczny.com\">sklep@numizmatyczny.com</a>;</span></p>\n<p style=\"text-align:justify;padding-left:30px;\"><span style=\"font-family:arial, helvetica, sans-serif;color:#000000;font-size:10pt;\"><strong>7.2. </strong>Zaleca się podanie przez Klienta w opisie reklamacji:</span></p>\n<p style=\"padding-left:60px;text-align:justify;\"><span style=\"font-family:arial, helvetica, sans-serif;color:#000000;font-size:10pt;\"><strong>7.2.1. </strong>informacji i okoliczności dotyczących przedmiotu reklamacji, w szczególności rodzaju i daty wystąpienia wady,</span></p>\n<p style=\"padding-left:60px;text-align:justify;\"><span style=\"font-family:arial, helvetica, sans-serif;color:#000000;font-size:10pt;\"><strong>7.2.2. </strong>żądania sposobu doprowadzenia Produktu do zgodności z Umową Sprzedaży lub oświadczenia o obniżeniu ceny albo odstąpieniu od Umowy Sprzedaży,</span></p>\n<p style=\"padding-left:60px;text-align:justify;\"><span style=\"font-family:arial, helvetica, sans-serif;color:#000000;font-size:10pt;\"><strong>7.2.3. </strong>danych kontaktowych składającego reklamację – ułatwi to i przyspieszy rozpatrzenie reklamacji przez Sprzedawcę. Podane wymogi mają wyłącznie formę zalecenia i nie wpływają na skuteczność reklamacji złożonych z pominięciem zalecanego opisu.</span></p>\n<p style=\"text-align:justify;padding-left:30px;\"><span style=\"font-family:arial, helvetica, sans-serif;color:#000000;font-size:10pt;\"><strong>7.3. </strong>Sprzedawca ustosunkuje się do złożonej reklamacji niezwłocznie, nie później niż w terminie 14 dni kalendarzowych od dnia jej złożenia. Brak ustosunkowania się Sprzedawcy w tym terminie oznacza, że Sprzedawca uznał reklamację za uzasadnioną.</span></p>\n<p style=\"text-align:justify;padding-left:30px;\"><span style=\"font-family:arial, helvetica, sans-serif;color:#000000;font-size:10pt;\"><strong>7.4. </strong>Klient, który wykonuje uprawnienia z tytułu rękojmi, jest obowiązany na koszt Sprzedawcy dostarczyć Produkt wadliwy na adres: ul. Warszawska 26, 40-008 Katowice. Jeżeli ze względu na rodzaj Produktu, jego dostarczenie przez byłoby nadmiernie utrudnione, Klient obowiązany jest udostępnić Produkt Sprzedawcy w miejscu, w którym Produkt się znajduje, w celu jego odbioru.</span></p>\n<h1><span style=\"font-size:12pt;\">8. POZASĄDOWE SPOSOBY ROZPATRYWANIA REKLAMACJI I DOCHODZENIA ROSZCZEŃ ORAZ ZASADY DOSTĘPU DO TYCH PROCEDUR</span></h1>\n<p style=\"text-align:justify;padding-left:30px;\"><span style=\"font-family:arial, helvetica, sans-serif;font-size:10pt;color:#000000;\"><strong>8.1.</strong> Niniejszy punkt regulaminu nie dotyczy osób fizycznych zawierających umowy bezpośrednio związane z ich działalnością gospodarczą, gdy z treści tych umów wynika, że nie posiadają one dla tej osoby charakteru zawodowego, wynikającego w szczególności z przedmiotu wykonywanej przez nie działalności gospodarczej, udostępnionego na podstawie przepisów o Centralnej Ewidencji i Informacji o Działalności Gospodarczej.</span></p>\n<p style=\"text-align:justify;padding-left:30px;\"><span style=\"font-size:10pt;font-family:arial, helvetica, sans-serif;color:#000000;\"><strong>8.2.</strong> Klient będący konsumentem ma możliwość skorzystania z pozasądowych sposobów rozpatrywania reklamacji i dochodzenia roszczeń. Zasady dostępu do tych procedur dostępne są w siedzibach oraz na stronach internetowych powiatowych (miejskich) rzeczników konsumentów, organizacji społecznych, do których zadań statutowych należy ochrona konsumentów, Wojewódzkich Inspektoratów Inspekcji Handlowej oraz pod następującymi adresami internetowymi Urzędu Ochrony Konkurencji i Konsumentów: <a style=\"color:#000000;\" href=\"http://www.uokik.gov.pl/spory_konsumenckie.php;\">http://www.uokik.gov.pl/spory_konsumenckie.php;</a> <a style=\"color:#000000;\" href=\"http://www.uokik.gov.pl/sprawy_indywidualne.php\">http://www.uokik.gov.pl/sprawy_indywidualne.php</a> oraz <a style=\"color:#000000;\" href=\"http://www.uokik.gov.pl/wazne_adresy.php.\">http://www.uokik.gov.pl/wazne_adresy.php.</a></span></p>\n<p style=\"text-align:justify;padding-left:30px;\"><span style=\"font-size:10pt;font-family:arial, helvetica, sans-serif;color:#000000;\"><strong>8.3.</strong> Klient będący konsumentem posiada następujące przykładowe możliwości skorzystania z pozasądowych sposobów rozpatrywania reklamacji i dochodzenia roszczeń:</span></p>\n<p style=\"padding-left:60px;text-align:justify;\"><span style=\"font-size:10pt;font-family:arial, helvetica, sans-serif;color:#000000;\"><strong>8.3.1.</strong> Do polubownego sądu konsumenckiego, o którym mowa w art. 37 ustawy z dnia 15 grudnia 2000 r. o Inspekcji Handlowej (Dz.U. 2001 nr 4 poz. 25) Konsument może zwrócić się z wnioskiem o rozstrzygnięcie sporu wynikłego z zawartej Umowy Sprzedaży.</span></p>\n<p style=\"padding-left:60px;text-align:justify;\"><span style=\"font-size:10pt;font-family:arial, helvetica, sans-serif;color:#000000;\"><strong>8.3.2.</strong> Konsument uprawniony jest do zwrócenia się do wojewódzkiego inspektora Inspekcji Handlowej, zgodnie z art. 36 ustawy z dnia 15 grudnia 2000 r. o Inspekcji Handlowej (Dz.U. 2001 nr 4 poz. 25), z wnioskiem o wszczęcie postępowania mediacyjnego w sprawie polubownego zakończenia sporu między Klientem, a Sprzedawcą.</span></p>\n<p style=\"padding-left:60px;text-align:justify;\"><span style=\"font-size:10pt;font-family:arial, helvetica, sans-serif;color:#000000;\"><strong>8.3.3.</strong> Konsument może uzyskać bezpłatną pomoc w sprawie rozstrzygnięcia sporu między Klientem, a Sprzedawcą, korzystając także z bezpłatnej pomocy powiatowego (miejskiego) rzecznika konsumentów lub organizacji społecznej, do której zadań statutowych należy ochrona konsumentów (m.in. Federacja Konsumentów, Stowarzyszenie Konsumentów Polskich).</span></p>\n<h1> </h1>\n<h1><span style=\"font-size:12pt;\">9. POSTANOWIENIA DOTYCZĄCE KLIENTÓW NIEBĘDĄCYCH KONSUMENTAMI</span></h1>\n<p style=\"padding-left:30px;text-align:justify;\"><span style=\"color:#000000;font-family:arial, helvetica, sans-serif;font-size:10pt;\"><strong>9.1.</strong> Niniejszy punkt Regulaminu oraz postanowienia w nim zawarte dotyczą wyłącznie Klientów i Usługobiorców nie będących Konsumentami w rozumieniu Kodeksu cywilnego.</span></p>\n<p style=\"padding-left:30px;text-align:justify;\"><span style=\"color:#000000;font-family:arial, helvetica, sans-serif;font-size:10pt;\"><strong>9.2. </strong>Sprzedawcy przysługuje prawo odstąpienia, o którym mowa w art. 395 Kodeksu cywilnego, od Umowy Sprzedaży zawartej z Klientem niebędącym konsumentem w terminie 14 dni kalendarzowych od dnia jej zawarcia. Odstąpienie od Umowy Sprzedaży w tym wypadku może nastąpić bez podania przyczyny i nie rodzi po stronie Klienta niebędącego konsumentem żadnych roszczeń w stosunku do Sprzedawcy.</span></p>\n<p style=\"padding-left:30px;text-align:justify;\"><span style=\"color:#000000;font-family:arial, helvetica, sans-serif;font-size:10pt;\"><strong>9.3. </strong>W wypadku Klientów nie będących konsumentami Sprzedawca ma prawo ograniczyć dostępne sposoby płatności, w tym także wymagać dokonania przedpłaty w całości albo części i to niezależnie od wybranego przez Klienta sposobu płatności oraz faktu zawarcia Umowy Sprzedaży.</span></p>\n<p style=\"padding-left:30px;text-align:justify;\"><span style=\"color:#000000;font-family:arial, helvetica, sans-serif;font-size:10pt;\"><strong>9.4. </strong>Wraz z wydaniem przez Sprzedawcę Produktu przewoźnikowi przechodzą na Klienta nie będącego konsumentem korzyści i ciężary związane z Produktem oraz niebezpieczeństwo przypadkowej utraty lub uszkodzenia Produktu. Sprzedawca w takim wypadku nie ponosi odpowiedzialności za utratę, ubytek lub uszkodzenie Produktu powstałe od przyjęcia go do przewozu aż do wydania go Klientowi oraz za opóźnienie w przewozie przesyłki.</span></p>\n<p style=\"padding-left:30px;text-align:justify;\"><span style=\"color:#000000;font-family:arial, helvetica, sans-serif;font-size:10pt;\"><strong>9.5. </strong>W razie przesłania Produktu do Klienta za pośrednictwem przewoźnika Klient nie będący konsumentem obowiązany jest zbadać przesyłkę w czasie i w sposób przyjęty przy przesyłkach tego rodzaju. Jeżeli stwierdzi, że w czasie przewozu nastąpił ubytek lub uszkodzenie Produktu, obowiązany jest dokonać wszelkich czynności niezbędnych do ustalenia odpowiedzialności przewoźnika.</span></p>\n<p style=\"padding-left:30px;text-align:justify;\"><span style=\"color:#000000;font-family:arial, helvetica, sans-serif;font-size:10pt;\"><strong>9.6. </strong>Odpowiedzialność Sprzedawcy z tytułu rękojmi za Produkt wobec Klienta nie będącego konsumentem zostaje wyłączona – zgodnie z art. 558 § 1 Kodeksu Cywilnego.</span></p>\n<p style=\"padding-left:30px;text-align:justify;\"><span style=\"color:#000000;font-family:arial, helvetica, sans-serif;font-size:10pt;\"><strong>9.7. </strong>W odniesieniu do Usługobiorców nie będących konsumentami, Usługodawca może wypowiedzieć umowę o świadczenie Usługi Elektronicznej ze skutkiem natychmiastowym i bez wskazywania przyczyn poprzez przesłanie Usługobiorcy stosownego oświadczenia.</span></p>\n<p style=\"padding-left:30px;text-align:justify;\"><span style=\"color:#000000;font-family:arial, helvetica, sans-serif;font-size:10pt;\"><strong>9.8. </strong>Odpowiedzialność Usługodawcy/Sprzedawcy wobec Usługobiorcy/Klienta nie będącego konsumentem, bez względu na podstawę prawną, jest ograniczona do wysokości zapłaconej ceny oraz kosztów dostawy z tytułu Umowy Sprzedaży, zarówno w ramach pojedynczego roszczenia, jak również za wszelkie roszczenia w sumie - nie więcej niż do kwoty tysiąca złotych.</span></p>\n<p style=\"padding-left:30px;text-align:justify;\"><span style=\"color:#000000;font-family:arial, helvetica, sans-serif;font-size:10pt;\"><strong>9.9. </strong>Usługodawca/Sprzedawca ponosi odpowiedzialność w wobec Usługobiorcy/Klienta nie będącego konsumentem wyłącznie za typowe szkody przewidywalne w momencie zawarcia umowy i nie ponosi odpowiedzialności z tytułu utraconych korzyści.</span></p>\n<p style=\"padding-left:30px;text-align:justify;\"><span style=\"color:#000000;font-family:arial, helvetica, sans-serif;font-size:10pt;\"><strong>9.10. </strong>Sądami właściwymi dla sporów powstałych pomiędzy Sprzedawcą/Usługodawcą a Klientem/Usługobiorcą niebędącym konsumentem będą sądy właściwe dla siedziby Sprzedawcy/Usługodawcy.</span></p>\n<h1> </h1>\n<h1><span style=\"font-size:12pt;\">10. POSTANOWIENIA KOŃCOWE</span></h1>\n<p style=\"padding-left:30px;text-align:justify;\"><span style=\"font-family:arial, helvetica, sans-serif;color:#000000;font-size:10pt;\"><strong>10.1.</strong> Umowy zawierane poprzez Sklep Internetowy zawierane są w języku polskim.</span></p>\n<p style=\"padding-left:30px;text-align:justify;\"><span style=\"font-family:arial, helvetica, sans-serif;color:#000000;font-size:10pt;\"><strong>10.2.</strong> Zmiana Regulaminu:</span></p>\n<p style=\"padding-left:60px;text-align:justify;\"><span style=\"font-family:arial, helvetica, sans-serif;color:#000000;font-size:10pt;\"><strong>10.2.1.</strong> Usługodawca zastrzega sobie prawo do dokonywania zmian Regulaminu z ważnych przyczyn, przede wszystkim zmiany przepisów prawa lub zmian w sposobach płatności lub dostaw.</span></p>\n<p style=\"padding-left:60px;text-align:justify;\"><span style=\"font-family:arial, helvetica, sans-serif;color:#000000;font-size:10pt;\"><strong>10.2.2. </strong>W przypadku zawarcia na podstawie niniejszego Regulaminu umów o charakterze ciągłym, kiedy zostanie on zmieniony, to wiąże Usługobiorcę, jeżeli został on prawidłowo poinformowany o zmianach i nie wypowiedział umowy w terminie 14 dni kalendarzowych od dnia poinformowania. W wypadku, gdyby zmiana Regulaminu skutkowała wprowadzeniem nowych lub podwyższeniem obecnych opłat, Konsument ma prawo odstąpienia od umowy.</span></p>\n<p style=\"padding-left:60px;text-align:justify;\"><span style=\"font-family:arial, helvetica, sans-serif;color:#000000;font-size:10pt;\"><strong>10.2.3. </strong>W przypadku zawarcia na podstawie niniejszego Regulaminu umów innego rodzaju niż umowy ciągłe, zmiany Regulaminu nie będą naruszać praw nabytych przez Usługobiorców/Klientów będących konsumentami przed dniem wejścia w życie zmian Regulaminu, w szczególności zmiany Regulaminu pozostaną bez wpływu na składane lub złożone Zamówienia oraz zawarte, realizowane lub zrealizowane Umowy.</span></p>\n<p style=\"padding-left:30px;\"> </p>\n<p style=\"padding-left:30px;\"> </p>\n<p style=\"padding-left:30px;\"> </p>\n<p style=\"padding-left:30px;\"> </p>\n<p style=\"padding-left:30px;\"> </p>\n<p style=\"padding-left:30px;\"> </p>\n<p style=\"color:#000000;\"><strong>Załącznik nr 1</strong> do Regulaminu – Formularz odstąpienia od umowy</p>\n<p> </p>\n<p style=\"text-align:center;color:#000000;\"><strong>FORMULARZA ODSTĄPIENIA OD UMOWY</strong></p>\n<p>do:</p>\n<p style=\"text-align:justify;color:#000000;\"><strong>Jakuba Starańskiego</strong> prowadzącego działalność gospodarczą pod firmą <strong>JS Partner Jakub Starański</strong> wpisaną do Centralnej Ewidencji i Informacji o Działalności Gospodarczej Rzeczypospolitej Polskiej prowadzonej przez ministra właściwego do spraw gospodarki, posiadająca: adres miejsca wykonywania działalności i adres do doręczeń: ul. Warszawska 26, 40-008 Katowice, NIP: 6412419384, REGON: 243535017, adres poczty elektronicznej: sklep@numizmatyczny.com, numer telefonu: 502 210 907</p>\n<p style=\"text-align:justify;color:#000000;\">–Ja/My(*)niniejszym informuję/informujemy(*)o moim/naszym odstąpieniu od umowy sprzedaży następujących rzeczy(*)umowy dostawy następujących rzeczy(*)</p>\n<p style=\"text-align:justify;color:#000000;\">–Data zawarcia umowy(*)/odbioru(*)</p>\n<p style=\"text-align:justify;color:#000000;\">–Imię i nazwisko konsumenta(-ów)</p>\n<p style=\"text-align:justify;color:#000000;\">–Adres konsumenta(-ów)</p>\n<p style=\"text-align:justify;color:#000000;\">–Podpis konsumenta(-ów) (tylko jeżeli formularz jest przesyłany w wersji papierowej)</p>\n<p style=\"text-align:justify;color:#000000;\">–Data</p>\n</div>','regulamin'),(9,1,1,'blog','','','','<div class=\"row article-header\"><img src=\"/libraries/images/1px.gif\" alt=\"\" class=\"px1\" /> <a class=\"article-name\" href=\"/banknot-lech-kaczynski-blog\">Banknot kolekcjonerski 20 zł z Lechem Kaczyńskim</a> <a class=\"article-comments\" href=\"/banknot-lech-kaczynski-blog#commentform\"> 0 </a></div>\n<div class=\"row article-info\">Dodano: <span class=\"article-date\">04-10-2021</span> w kategorii: <span class=\"article-categories\"><a href=\"/pl/blog/category/Sklep-Numizmatyczny-Katowice/1\">Sklep Numizmatyczny Katowice</a></span> autor: <span class=\"article-author\">Wiktor Matyaszek</span></div>\n<div class=\"resetcss fr-view row article-content\"><img class=\"article-image\" src=\"https://numizmatyczny.com/userdata/public/news/images/95.jpg\" alt=\"Banknot kolekcjonerski 20 zł z Lechem Kaczyńskim\" />\n<p style=\"text-align:justify;\"><span style=\"font-size:12pt;font-family:\'book antiqua\', palatino, serif;\">Jego historia sięga początku 2020 roku, kiedy to zrodził się pomysł na emisję banknotu kolekcjonerskiego, </span><span style=\"font-size:12pt;font-family:\'book antiqua\', palatino, serif;\">na którym widnieć miałaby postać Lecha Kaczyńskiego.</span></p>\n<p style=\"text-align:justify;\"><span style=\"font-size:12pt;font-family:\'book antiqua\', palatino, serif;\">Temat wrócił już po kilku miesiącach, gdy Narodowy Bank Polski potwierdził plan wprowadzenia [...]</span></p>\n</div>\n<p><a class=\"readmore\" href=\"/banknot-lech-kaczynski-blog\">czytaj całość »</a></p>\n<div class=\"row article-header\"><img src=\"/libraries/images/1px.gif\" alt=\"\" class=\"px1\" /> <a class=\"article-name\" href=\"/katalogi-monet-polskich\">3 BIBLIE O MONETACH I KAŻDA DAJE WARTOŚĆ!</a> <a class=\"article-comments\" href=\"/katalogi-monet-polskich#commentform\"> 0 </a></div>\n<div class=\"row article-info\">Dodano: <span class=\"article-date\">07-06-2021</span> w kategorii: <span class=\"article-categories\"><a href=\"/pl/blog/category/Sklep-Numizmatyczny-Katowice/1\">Sklep Numizmatyczny Katowice</a></span> autor: <span class=\"article-author\">Wiktor Matyaszek</span></div>\n<div class=\"resetcss fr-view row article-content\"><img class=\"article-image\" src=\"/userdata/public/news/images/89.jpg\" alt=\"3 BIBLIE O MONETACH I KAŻDA DAJE WARTOŚĆ!\" />\n<p><span style=\"font-family:\'book antiqua\', palatino, serif;font-size:12pt;\">Przedstawiamy bardzo przydatne i bogate w merytoryczną treść katalogi monet polskich wybijanych za panowania wielu królów i władców w historii kraju.</span><br /><span style=\"font-family:\'book antiqua\', palatino, serif;font-size:12pt;\">Znajdują się w nich informacje i zdjęcia monet z wielu okresów historycznych Polski.</span><br /><span style=\"font-family:\'book antiqua\', palatino, serif;font-size:12pt;\">Każdy katalog to około 400 stron sprecyzowanej wiedzy zamkniętej w twardej, solidnie wykonanej oprawie! [...]</span></p>\n</div>\n<p><a class=\"readmore\" href=\"/katalogi-monet-polskich\">czytaj całość »</a></p>\n<div class=\"row article-header\"><img src=\"/libraries/images/1px.gif\" alt=\"\" class=\"px1\" /> <a class=\"article-name\" href=\"/katalog-ortow-blog\">Jeden z największych portów średniowiecznej Europy czyli dlaczego Gdańsk zaczął wybijać własne monety</a> <a class=\"article-comments\" href=\"/katalog-ortow-blog#commentform\"> 0 </a></div>\n<div class=\"row article-info\">Dodano: <span class=\"article-date\">25-02-2021</span> w kategorii: <span class=\"article-categories\"><a href=\"/pl/blog/category/Sklep-Numizmatyczny-Katowice/1\">Sklep Numizmatyczny Katowice</a></span> autor: <span class=\"article-author\">Wiktor Matyaszek</span></div>\n<div class=\"resetcss fr-view row article-content\"><img class=\"article-image\" src=\"/userdata/public/news/images/87.jpg\" alt=\"Jeden z największych portów średniowiecznej Europy czyli dlaczego Gdańsk zaczął wybijać własne monety\" />\n<p><span style=\"font-size:12pt;font-family:\'book antiqua\', palatino, serif;\">W XV wieku do Gdańska przypływało rocznie 400-700 statków.</span><br /><span style=\"font-size:12pt;font-family:\'book antiqua\', palatino, serif;\">W XVII wieku było to już 1000-1600 statków.</span><br /><span style=\"font-size:12pt;font-family:\'book antiqua\', palatino, serif;\">Przewoziły głównie zboże, wosk, miód oraz drewno.</span><br /><span style=\"font-size:12pt;font-family:\'book antiqua\', palatino, serif;\">Powstał tam również największy dźwig portowy średniowiecznej Europy.</span><br /><span style=\"font-size:12pt;font-family:\'book antiqua\', palatino, serif;\">Wyobraź to sobie. Miasto tętniło handlem. [...]</span></p>\n</div>\n<p><a class=\"readmore\" href=\"/katalog-ortow-blog\">czytaj całość »</a></p>\n<div class=\"row article-header\"><img src=\"/libraries/images/1px.gif\" alt=\"\" class=\"px1\" /> <a class=\"article-name\" href=\"/historia-monety-polskiej-czesc-IX\">Gruba moneta Władysława IV, czyli Historia Monety Polskiej - część IX</a> <a class=\"article-comments\" href=\"/historia-monety-polskiej-czesc-IX#commentform\"> 0 </a></div>\n<div class=\"row article-info\">Dodano: <span class=\"article-date\">01-12-2020</span> w kategorii: <span class=\"article-categories\"><a href=\"/pl/blog/category/Sklep-Numizmatyczny-Katowice/1\">Sklep Numizmatyczny Katowice</a></span> autor: <span class=\"article-author\">Izabela Skupin</span></div>\n<div class=\"resetcss fr-view row article-content\"><img class=\"article-image\" src=\"/userdata/public/news/images/82.jpg\" alt=\"Gruba moneta Władysława IV, czyli Historia Monety Polskiej - część VIII\" />\n<p style=\"text-align:justify;\"><span style=\"font-size:12pt;font-family:\'book antiqua\', palatino, serif;\"><span style=\"font-weight:400;\">Podczas panowania Władysława IV mennice nie emitowały drobnych monet. Skupiały się na produkcji monet grubych w postaci złotych dukatów oraz srebrnych półtalarów i talarów. Sejm jeszcze w 1627 roku zakazał bowiem jej emitowania, ponieważ do kraju napłynęło bardzo dużo obcej monety o złej jakości. Przedstawiona moneta jest talarem emitowanym przez mennicę bydgoską w 1642 roku.</span> [...]</span></p>\n</div>\n<p><a class=\"readmore\" href=\"/historia-monety-polskiej-czesc-IX\">czytaj całość »</a></p>\n<div class=\"row article-header\"><img src=\"/libraries/images/1px.gif\" alt=\"\" class=\"px1\" /> <a class=\"article-name\" href=\"/ciekawostka-numizmatyczna-najpiekniejsza-waluta\">30# ciekawostka numizmatyczna</a> <a class=\"article-comments\" href=\"/ciekawostka-numizmatyczna-najpiekniejsza-waluta#commentform\"> 0 </a></div>\n<div class=\"row article-info\">Dodano: <span class=\"article-date\">27-11-2020</span> w kategorii: <span class=\"article-categories\"><a href=\"/pl/blog/category/Sklep-Numizmatyczny-Katowice/1\">Sklep Numizmatyczny Katowice</a></span> autor: <span class=\"article-author\">Izabela Skupin</span></div>\n<div class=\"resetcss fr-view row article-content\"><img class=\"article-image\" src=\"/userdata/public/news/images/85.jpg\" alt=\"30# ciekawostka numizmatyczna\" />\n<p style=\"text-align:justify;\"><span style=\"font-size:12pt;font-family:\'book antiqua\', palatino, serif;\">Czy wiesz, że organizowane są konkursy na najpiękniejszą walutę?</span><strong> <br /></strong></p>\n</div>\n<p><a class=\"readmore\" href=\"/ciekawostka-numizmatyczna-najpiekniejsza-waluta\">czytaj całość »</a></p>\n<div class=\"row article-header\"><img src=\"/libraries/images/1px.gif\" alt=\"\" class=\"px1\" /> <a class=\"article-name\" href=\"/ciekawostka-numizmatyczna-waluty-swiata\">29# ciekawostka numizmatyczna</a> <a class=\"article-comments\" href=\"/ciekawostka-numizmatyczna-waluty-swiata#commentform\"> 0 </a></div>\n<div class=\"row article-info\">Dodano: <span class=\"article-date\">25-11-2020</span> w kategorii: <span class=\"article-categories\"><a href=\"/pl/blog/category/Sklep-Numizmatyczny-Katowice/1\">Sklep Numizmatyczny Katowice</a></span> autor: <span class=\"article-author\">Izabela Skupin</span></div>\n<div class=\"resetcss fr-view row article-content\"><img class=\"article-image\" src=\"/userdata/public/news/images/84.jpg\" alt=\"29# ciekawostka numizmatyczna\" />\n<p><span style=\"font-size:12pt;font-family:\'book antiqua\', palatino, serif;\">Czy wiesz, że na świecie jest ponad 150 walut będących w obiegu?</span></p>\n<p> </p>\n</div>\n<p><a class=\"readmore\" href=\"/ciekawostka-numizmatyczna-waluty-swiata\">czytaj całość »</a></p>\n<div class=\"row article-header\"><img src=\"/libraries/images/1px.gif\" alt=\"\" class=\"px1\" /> <a class=\"article-name\" href=\"/historia-monety-polskiej-czesc-VIII\">Złota epoka w mennictwie polskim, czyli Historia Monety Polskiej - część VIII</a> <a class=\"article-comments\" href=\"/historia-monety-polskiej-czesc-VIII#commentform\"> 0 </a></div>\n<div class=\"row article-info\">Dodano: <span class=\"article-date\">24-11-2020</span> w kategorii: <span class=\"article-categories\"><a href=\"/pl/blog/category/Sklep-Numizmatyczny-Katowice/1\">Sklep Numizmatyczny Katowice</a></span> autor: <span class=\"article-author\">Izabela Skupin</span></div>\n<div class=\"resetcss fr-view row article-content\"><img class=\"article-image\" src=\"/userdata/public/news/images/81.jpg\" alt=\"Złota epoka w mennictwie polskim, czyli Historia Monety Polskiej - część VI\" />\n<p style=\"text-align:justify;\"><span style=\"font-weight:400;font-size:12pt;font-family:\'book antiqua\', palatino, serif;\">W mennictwo polskie wraz z panowaniem Zygmunta III Wazy weszło w  całkowicie nową złotą epokę, która łączyła się z emisją złotych monet. Niektóre z nich przetrwały do dziś i są sprzedawane na aukcjach w zawrotnych cenach. W 2018 roku na aukcje w Stanach Zjednoczonych trafiła moneta o nominale 100 dukatów Zygmunta III Wazy, która jest białym krukiem wśród innych numizmatów. Moneta, która trafiła na aukcję należała do monet wybitych i zaprojektowanych przez najwybitniejszych medalierów tamtej epoki m.in. medaliera gdańskiego Samuela Ammona (1591–1622). Jej nakład był limitowany, ponieważ była to  moneta prezentowa. Jest to najdroższa znana polska moneta. [...]</span></p>\n</div>\n<p><a class=\"readmore\" href=\"/historia-monety-polskiej-czesc-VIII\">czytaj całość »</a></p>\n<div class=\"row article-header\"><img src=\"/libraries/images/1px.gif\" alt=\"\" class=\"px1\" /> <a class=\"article-name\" href=\"/destrukty-i-bledy-mennicze\">Błędy mogą sporo kosztować nawet w numizmatyce.</a> <a class=\"article-comments\" href=\"/destrukty-i-bledy-mennicze#commentform\"> 0 </a></div>\n<div class=\"row article-info\">Dodano: <span class=\"article-date\">23-11-2020</span> w kategorii: <span class=\"article-categories\"><a href=\"/pl/blog/category/Sklep-Numizmatyczny-Katowice/1\">Sklep Numizmatyczny Katowice</a></span> autor: <span class=\"article-author\">Izabela Skupin</span></div>\n<div class=\"resetcss fr-view row article-content\"><img class=\"article-image\" src=\"/userdata/public/news/images/80.jpg\" alt=\"Błędy mogą sporo kosztować nawet w numizmatyce.\" />\n<p style=\"text-align:justify;\"><span style=\"font-weight:400;font-size:12pt;font-family:\'book antiqua\', palatino, serif;\">Stan zachowania monet jest drugą co do ważności informacją pomocną przy szacowaniu wyceny monety. Czasem to nie stopień rzadkości, a stopień zachowania monety jest wartością dominującą podczas wyceny kolekcji monet. Zaprezentowana poniżej skala jest uniwersalna i dotyczy monet od starożytności do współczesności. [...]</span></p>\n<p> </p>\n</div>\n<p><a class=\"readmore\" href=\"/destrukty-i-bledy-mennicze\">czytaj całość »</a></p>\n<div class=\"row article-header\"><img src=\"/libraries/images/1px.gif\" alt=\"\" class=\"px1\" /> <a class=\"article-name\" href=\"/ciekawostka-numizmatyczna-najwyzszy-nominal\">28# ciekawostka numizmatyczna</a> <a class=\"article-comments\" href=\"/ciekawostka-numizmatyczna-najwyzszy-nominal#commentform\"> 0 </a></div>\n<div class=\"row article-info\">Dodano: <span class=\"article-date\">20-11-2020</span> w kategorii: <span class=\"article-categories\"><a href=\"/pl/blog/category/Sklep-Numizmatyczny-Katowice/1\">Sklep Numizmatyczny Katowice</a></span> autor: <span class=\"article-author\">Izabela Skupin</span></div>\n<div class=\"resetcss fr-view row article-content\"><img class=\"article-image\" src=\"/userdata/public/news/images/83.jpg\" alt=\"28# ciekawostka numizmatyczna\" />\n<p style=\"text-align:justify;\"><span style=\"font-size:12pt;font-family:\'book antiqua\', palatino, serif;\">Czy wiesz, że to właśnie Węgry mogą pochwalić się banknotami o bardzo wysokich nominałach?</span></p>\n<p> </p>\n</div>\n<p><a class=\"readmore\" href=\"/ciekawostka-numizmatyczna-najwyzszy-nominal\">czytaj całość »</a></p>\n<div class=\"row article-header\"><img src=\"/libraries/images/1px.gif\" alt=\"\" class=\"px1\" /> <a class=\"article-name\" href=\"/ciekawostka-numizmatyczna-oszczedne-panstwa\">27# ciekawostka numizmatyczna</a> <a class=\"article-comments\" href=\"/ciekawostka-numizmatyczna-oszczedne-panstwa#commentform\"> 0 </a></div>\n<div class=\"row article-info\">Dodano: <span class=\"article-date\">18-11-2020</span> w kategorii: <span class=\"article-categories\"><a href=\"/pl/blog/category/Sklep-Numizmatyczny-Katowice/1\">Sklep Numizmatyczny Katowice</a></span> autor: <span class=\"article-author\">Izabela Skupin</span></div>\n<div class=\"resetcss fr-view row article-content\"><img class=\"article-image\" src=\"/userdata/public/news/images/79.jpg\" alt=\"27# ciekawostka numizmatyczna\" />\n<p><span style=\"font-size:12pt;font-family:\'book antiqua\', palatino, serif;\">Czy wiesz, że najoszczędniejszym narodem jest Szwajcaria, natomiast najmniej jest Cypr? </span></p>\n</div>\n<p><a class=\"readmore\" href=\"/ciekawostka-numizmatyczna-oszczedne-panstwa\">czytaj całość »</a></p>\n<div class=\"row article-header\"><img src=\"/libraries/images/1px.gif\" alt=\"\" class=\"px1\" /> <a class=\"article-name\" href=\"/historia-monety-polskiej-czesc-VII\">Nowe mennictwo Zygmunta Starego i Stefana Batorego, czyli Historia Monety Polskiej - część VII</a> <a class=\"article-comments\" href=\"/historia-monety-polskiej-czesc-VII#commentform\"> 0 </a></div>\n<div class=\"row article-info\">Dodano: <span class=\"article-date\">17-11-2020</span> w kategorii: <span class=\"article-categories\"><a href=\"/pl/blog/category/Sklep-Numizmatyczny-Katowice/1\">Sklep Numizmatyczny Katowice</a></span> autor: <span class=\"article-author\">Izabela Skupin</span></div>\n<div class=\"resetcss fr-view row article-content\"><img class=\"article-image\" src=\"/userdata/public/news/images/78.jpg\" alt=\"Nowe mennictwo Zygmunta Starego i Stefana Batorego, czyli Historia Monety Polskiej - część VI\" />\n<p style=\"text-align:justify;\"><span style=\"font-size:12pt;font-family:\'book antiqua\', palatino, serif;\"><span style=\"font-weight:400;\">Wraz z dukatem Zygmunta Starego polskie mennictwo weszło w nową epokę w historii pieniądza. Dukat był pierwszą polską złotą monetą, która może być uważana za środek płatniczy i monetę obiegową</span>. [...]</span></p>\n</div>\n<p><a class=\"readmore\" href=\"/historia-monety-polskiej-czesc-VII\">czytaj całość »</a></p>\n<div class=\"row article-header\"><img src=\"/libraries/images/1px.gif\" alt=\"\" class=\"px1\" /> <a class=\"article-name\" href=\"/skala-rzadkosci-monet\">Stopnie rzadkości monet</a> <a class=\"article-comments\" href=\"/skala-rzadkosci-monet#commentform\"> 0 </a></div>\n<div class=\"row article-info\">Dodano: <span class=\"article-date\">16-11-2020</span> w kategorii: <span class=\"article-categories\"><a href=\"/pl/blog/category/Sklep-Numizmatyczny-Katowice/1\">Sklep Numizmatyczny Katowice</a></span> autor: <span class=\"article-author\">Izabela Skupin</span></div>\n<div class=\"resetcss fr-view row article-content\"><img class=\"article-image\" src=\"/userdata/public/news/images/76.jpg\" alt=\"Stopnie rzadkości monet\" />\n<p style=\"text-align:justify;\"><span style=\"font-weight:400;\"><span style=\"font-size:12pt;font-family:\'book antiqua\', palatino, serif;\">Do oszacowania rzadkości monety, bardzo ważną wręcz niezbędną informacją jest ilość monet, które znalazły się na samym początku w obiegu. Co ważne, współcześnie bite monety posiadają takie dane powszechnie dostępne, natomiast te starsze niestety nie. W celu oszacowania skali rzadkości monet emitowanych w  dawnych czasach kiedy takie katalogi praktycznie nie istniały, polski numizmatyk Emeryk Hutten-Czapski (1828–1896) w XIX wieku opracował i wprowadził do użytku skalę rzadkości monet wyrażoną symbolami od R, R1  do R8 oraz R*. [...]</span><br /></span></p>\n</div>\n<p><a class=\"readmore\" href=\"/skala-rzadkosci-monet\">czytaj całość »</a></p>\n<div class=\"row article-header\"><img src=\"/libraries/images/1px.gif\" alt=\"\" class=\"px1\" /> <a class=\"article-name\" href=\"/ciekawostka-numizmatyczna-tajne-drukowanie\">26# ciekawostka numizmatyczna</a> <a class=\"article-comments\" href=\"/ciekawostka-numizmatyczna-tajne-drukowanie#commentform\"> 0 </a></div>\n<div class=\"row article-info\">Dodano: <span class=\"article-date\">13-11-2020</span> w kategorii: <span class=\"article-categories\"><a href=\"/pl/blog/category/Sklep-Numizmatyczny-Katowice/1\">Sklep Numizmatyczny Katowice</a></span> autor: <span class=\"article-author\">Izabela Skupin</span></div>\n<div class=\"resetcss fr-view row article-content\"><img class=\"article-image\" src=\"/userdata/public/news/images/75.jpg\" alt=\"26# ciekawostka numizmatyczna\" />\n<p style=\"text-align:justify;\"><span style=\"font-size:12pt;font-family:\'book antiqua\', palatino, serif;\">Czy wiesz, że PWPW drukowała pieniądze w latach 70 XX wieku na wypadek wojny?</span></p>\n</div>\n<p><a class=\"readmore\" href=\"/ciekawostka-numizmatyczna-tajne-drukowanie\">czytaj całość »</a></p>\n<div class=\"row article-header\"><img src=\"/libraries/images/1px.gif\" alt=\"\" class=\"px1\" /> <a class=\"article-name\" href=\"/ciekawostka-numizmatyczna-swinka-skarbonka\">25# ciekawostka numizmatyczna</a> <a class=\"article-comments\" href=\"/ciekawostka-numizmatyczna-swinka-skarbonka#commentform\"> 0 </a></div>\n<div class=\"row article-info\">Dodano: <span class=\"article-date\">11-11-2020</span> w kategorii: <span class=\"article-categories\"><a href=\"/pl/blog/category/Sklep-Numizmatyczny-Katowice/1\">Sklep Numizmatyczny Katowice</a></span> autor: <span class=\"article-author\">Izabela Skupin</span></div>\n<div class=\"resetcss fr-view row article-content\"><img class=\"article-image\" src=\"/userdata/public/news/images/74.jpg\" alt=\"25# ciekawostka numizmatyczna\" />\n<p style=\"text-align:justify;\"><span style=\"font-size:12pt;font-family:\'book antiqua\', palatino, serif;\">Czy wiesz, dlaczego to właśnie świnka skarbonka stała się synonimem oszczędności?</span></p>\n</div>\n<p><a class=\"readmore\" href=\"/ciekawostka-numizmatyczna-swinka-skarbonka\">czytaj całość »</a></p>\n<div class=\"row article-header\"><img src=\"/libraries/images/1px.gif\" alt=\"\" class=\"px1\" /> <a class=\"article-name\" href=\"/11-listopad-swieto-niepodleglosci\">102 rocznica odzyskania przez Polskę niepodległości</a> <a class=\"article-comments\" href=\"/11-listopad-swieto-niepodleglosci#commentform\"> 0 </a></div>\n<div class=\"row article-info\">Dodano: <span class=\"article-date\">11-11-2020</span> w kategorii: <span class=\"article-categories\"><a href=\"/pl/blog/category/Sklep-Numizmatyczny-Katowice/1\">Sklep Numizmatyczny Katowice</a></span> autor: <span class=\"article-author\">Izabela Skupin</span></div>\n<div class=\"resetcss fr-view row article-content\"><img class=\"article-image\" src=\"/userdata/public/news/images/73.jpg\" alt=\"102 rocznica odzyskania przez Polskę niepodległości\" />\n<p style=\"text-align:justify;\"><span style=\"font-weight:400;font-size:12pt;font-family:\'book antiqua\', palatino, serif;\">W dniu dzisiejszym Polska obchodzi 102 rocznicę odzyskania niepodległości. Niepodległość można traktować jako całkowite ukoronowanie patriotycznych i bohaterskich postaw oraz działań wielu osób. Polska dokładnie po 123 latach odzyskała swoją niepodległość. Proces odzyskiwania niepodległości był długotrwały, nie dokonał się z dnia na dzień. Wiele wydarzeń dziejących się na terenie całego kraju przybliżały Polskę do tej wzniosłej chwili, którą jest wolność.  [...]</span></p>\n</div>\n<p><a class=\"readmore\" href=\"/11-listopad-swieto-niepodleglosci\">czytaj całość »</a></p>\n<div class=\"row article-header\"><img src=\"/libraries/images/1px.gif\" alt=\"\" class=\"px1\" /> <a class=\"article-name\" href=\"/historia-monety-polskiej-czesc-VI\">Kolejna reforma monetarna, czyli Historia Monety Polskiej - część VI</a> <a class=\"article-comments\" href=\"/historia-monety-polskiej-czesc-VI#commentform\"> 0 </a></div>\n<div class=\"row article-info\">Dodano: <span class=\"article-date\">10-11-2020</span> w kategorii: <span class=\"article-categories\"><a href=\"/pl/blog/category/Sklep-Numizmatyczny-Katowice/1\">Sklep Numizmatyczny Katowice</a></span> autor: <span class=\"article-author\">Izabela Skupin</span></div>\n<div class=\"resetcss fr-view row article-content\"><img class=\"article-image\" src=\"/userdata/public/news/images/77.jpg\" alt=\"Kolejna reforma monetarna, czyli Historia Monety Polskiej - część V\" />\n<p style=\"text-align:justify;\"><span style=\"font-weight:400;\"><span style=\"font-size:12pt;font-family:\'book antiqua\', palatino, serif;\">Kolejnym reformatorem monetarnym na terenie Polski był król Władysław II Jagiełło, który wprowadził do obiegu srebrną monetę pół grosza, zwanego również kwartalnikiem dużym. Król podczas serii reform z lat 1393-1398 postanowił skupić się na emisji mniejszych nominałów, zamiast tych większych odpowiedników grosza. Półgrosz był bity w Polsce, na Litwie i na Śląsku od XIV do XVI wieku. W czasach panowania Jagiełły emitowano kwartniki duże koronne z 1394 roku oraz kwartniki ruskie z 1404 roku. [...]</span><br /></span></p>\n<p> </p>\n</div>\n<p><a class=\"readmore\" href=\"/historia-monety-polskiej-czesc-VI\">czytaj całość »</a></p>\n<div class=\"row article-header\"><img src=\"/libraries/images/1px.gif\" alt=\"\" class=\"px1\" /> <a class=\"article-name\" href=\"/historia-krugerrandow\">Historia Kruggerandów</a> <a class=\"article-comments\" href=\"/historia-krugerrandow#commentform\"> 0 </a></div>\n<div class=\"row article-info\">Dodano: <span class=\"article-date\">09-11-2020</span> w kategorii: <span class=\"article-categories\"><a href=\"/pl/blog/category/Sklep-Numizmatyczny-Katowice/1\">Sklep Numizmatyczny Katowice</a></span> autor: <span class=\"article-author\">Izabela Skupin</span></div>\n<div class=\"resetcss fr-view row article-content\"><img class=\"article-image\" src=\"/userdata/public/news/images/72.jpg\" alt=\"Historia Kruggerandów\" />\n<p style=\"text-align:justify;\"><span style=\"font-weight:400;font-size:12pt;font-family:\'book antiqua\', palatino, serif;\">Najsłynniejszą oraz pierwszą złotą monetą inwestycyjną na świecie był Krugerrand. Jest to pierwsza jednouncjowa złota moneta, która jest całkowicie uznanym prawnie środkiem płatniczym. Sama moneta zwykle nie posiada określonej wartości nominalnej, ponieważ jej wartość zależy od aktualnej ceny użytego kruszcu. Moneta zawiera domieszkę miedzi, która powoduje, że jest twarda i odporniejsza na czynniki mechaniczne jak ścieranie czy zarysowania lepiej niż czyste złoto. [...]</span></p>\n</div>\n<p><a class=\"readmore\" href=\"/historia-krugerrandow\">czytaj całość »</a></p>\n<div class=\"row article-header\"><img src=\"/libraries/images/1px.gif\" alt=\"\" class=\"px1\" /> <a class=\"article-name\" href=\"/ciekawostka-numizmatyczna-waluta-euro\">24# ciekawostka numizmatyczna</a> <a class=\"article-comments\" href=\"/ciekawostka-numizmatyczna-waluta-euro#commentform\"> 0 </a></div>\n<div class=\"row article-info\">Dodano: <span class=\"article-date\">03-11-2020</span> w kategorii: <span class=\"article-categories\"><a href=\"/pl/blog/category/Sklep-Numizmatyczny-Katowice/1\">Sklep Numizmatyczny Katowice</a></span> autor: <span class=\"article-author\">Izabela Skupin</span></div>\n<div class=\"resetcss fr-view row article-content\"><img class=\"article-image\" src=\"/userdata/public/news/images/71.jpg\" alt=\"24# ciekawostka numizmatyczna\" />\n<p><span style=\"font-size:12pt;font-family:\'book antiqua\', palatino, serif;\">Czy wiesz, że istnieje ponad 10 państw, które pomimo tego, że nie są częścią Unii Europejskiej posługują się walutą Euro?</span></p>\n<p> </p>\n</div>\n<p><a class=\"readmore\" href=\"/ciekawostka-numizmatyczna-waluta-euro\">czytaj całość »</a></p>\n<div class=\"row article-header\"><img src=\"/libraries/images/1px.gif\" alt=\"\" class=\"px1\" /> <a class=\"article-name\" href=\"/ciekawostka-numizmatyczna-obol-charona\">23# ciekawostka numizmatyczna</a> <a class=\"article-comments\" href=\"/ciekawostka-numizmatyczna-obol-charona#commentform\"> 0 </a></div>\n<div class=\"row article-info\">Dodano: <span class=\"article-date\">03-11-2020</span> w kategorii: <span class=\"article-categories\"><a href=\"/pl/blog/category/Sklep-Numizmatyczny-Katowice/1\">Sklep Numizmatyczny Katowice</a></span> autor: <span class=\"article-author\">Izabela Skupin</span></div>\n<div class=\"resetcss fr-view row article-content\"><img class=\"article-image\" src=\"/userdata/public/news/images/70.jpg\" alt=\"23# ciekawostka numizmatyczna\" />\n<p style=\"text-align:justify;\"><span style=\"font-size:12pt;font-family:\'book antiqua\', palatino, serif;\">Czy wiesz, że w różnych wierzeniach wkładano do ust zmarłemu monetę, aby miał czym zapłacić w drodze do zaświatów?</span></p>\n</div>\n<p><a class=\"readmore\" href=\"/ciekawostka-numizmatyczna-obol-charona\">czytaj całość »</a></p>\n<div class=\"row article-header\"><img src=\"/libraries/images/1px.gif\" alt=\"\" class=\"px1\" /> <a class=\"article-name\" href=\"/newsletter-listopadowe-okazje\">Newsletter numizmatyczny - listopadowe okazje</a> <a class=\"article-comments\" href=\"/newsletter-listopadowe-okazje#commentform\"> 0 </a></div>\n<div class=\"row article-info\">Dodano: <span class=\"article-date\">03-11-2020</span> w kategorii: <span class=\"article-categories\"><a href=\"/pl/blog/category/Sklep-Numizmatyczny-Katowice/1\">Sklep Numizmatyczny Katowice</a></span> autor: <span class=\"article-author\">Izabela Skupin</span></div>\n<div class=\"resetcss fr-view row article-content\"><img class=\"article-image\" src=\"/userdata/public/news/images/69.jpg\" alt=\"Newsletter numizmatyczny - listopadowe okazje\" />\n<p><span style=\"font-size:12pt;font-family:\'book antiqua\', palatino, serif;\">Jesień pełna numizmatycznych okazji [...]</span></p>\n</div>\n<p><a class=\"readmore\" href=\"/newsletter-listopadowe-okazje\">czytaj całość »</a></p>\n<div class=\"floatcenterwrap row\">\n<ul class=\"paginator\">\n<li class=\"first\"><span>«</span></li>\n<li class=\"selected\"><span>1</span></li>\n<li class=\"stick\"><span>|</span></li>\n<li><a href=\"/pl/blog/page/2\" title=\"Przejdź do strony 2\"> 2 </a></li>\n<li class=\"stick\"><span>|</span></li>\n<li><a href=\"/pl/blog/page/3\" title=\"Przejdź do strony 3\"> 3 </a></li>\n<li class=\"stick\"><span>|</span></li>\n<li><a href=\"/pl/blog/page/4\" title=\"Przejdź do strony 4\"> 4 </a></li>\n<li class=\"stick\"><span>|</span></li>\n<li><a href=\"/pl/blog/page/5\" title=\"Przejdź do strony 5\"> 5 </a></li>\n<li class=\"last\"><a href=\"/pl/blog/page/2\" title=\"Przejdź do następnej strony\"> » </a></li>\n</ul>\n</div>','blog'),(10,1,1,'dane kontaktowe','','','','<div class=\"boxhead\"><span> <img src=\"/libraries/images/1px.gif\" alt=\"\" class=\"px1\" /> Dane Kontaktowe </span></div>\n<div class=\"innerbox\">\n<div class=\"resetcss fr-view\">\n<p style=\"text-align:justify;color:#000000;\"><img style=\"padding:10px;float:right;\" title=\"Sklep numizmatyczny Katowice - Monety, Banknoty, Akcesoria - Skup, Sprzedaż, Komis\" src=\"https://numizmatyczny.com/public/assets/images/20180724_103727.jpg\" alt=\"Sklep numizmatyczny Katowice\" width=\"439\" height=\"504\" /></p>\n<p> </p>\n<p style=\"text-align:center;color:#000000;\"><strong>SKLEP</strong></p>\n<p style=\"text-align:center;color:#000000;\"><a title=\"Sklep numizmatyczny Katowice\" href=\"/\">NUMIZMATYCZNY.COM</a></p>\n<p style=\"text-align:center;color:#000000;\"><strong>KATOWICE</strong></p>\n<p style=\"text-align:center;color:#000000;\"><strong>40-008</strong></p>\n<p style=\"text-align:center;color:#000000;\"><strong>UL. WARSZAWSKA 26</strong></p>\n<p style=\"text-align:center;color:#000000;\"><strong>TEL. 502 210 907</strong></p>\n<p> </p>\n<p style=\"text-align:center;color:#000000;\"><strong>PONIEDZIAŁEK - PIĄTEK</strong></p>\n<p style=\"text-align:center;color:#000000;\"><strong>OD 10.00 DO 16.00</strong></p>\n<p style=\"text-align:center;color:#000000;\"><strong>SOBOTA, NIEDZIELA - NIECZYNNE</strong></p>\n<p style=\"text-align:center;color:#000000;\"><strong>sklep@numizmatyczny.com</strong></p>\n<p> </p>\n<p style=\"text-align:center;color:#000000;\"><strong>RACHUNEK BANKOWY PKO BP:</strong></p>\n<p style=\"text-align:center;color:#000000;\"><strong>PL 54 1020 2401 0000 0002 0462 2512</strong></p>\n<p> </p>\n<p> </p>\n<p> </p>\n<p style=\"text-align:center;color:#000000;\">Pełna Nazwa Firmy Prowadzącej / Dane do Faktur:</p>\n<p style=\"text-align:center;color:#000000;\">JS Partner Jakub Starański</p>\n<p style=\"text-align:center;color:#000000;\">Warszawska 26</p>\n<p style=\"text-align:center;color:#000000;\">40-008 Katowice</p>\n<p style=\"text-align:center;color:#000000;\">NIP: 6412419384</p>\n<p style=\"text-align:center;color:#000000;\">REGON: 243535017</p>\n<p style=\"text-align:center;color:#000000;\">Osoba reprezentująca firmę: Jakub Starański</p>\n<p style=\"text-align:center;color:#000000;\">Numer telefonu: 512 353 791</p>\n<p style=\"text-align:center;color:#000000;\">Adres e-mail: <a href=\"mailto:j.staranski@gmail.com\">j.staranski@gmail.com</a></p>\n</div>\n</div>','dane-kontaktowe'),(11,1,1,'cookies','','','','<div class=\"boxhead\"><span> <img src=\"/libraries/images/1px.gif\" alt=\"\" class=\"px1\" /> Polityka cookies </span></div>\n<div class=\"innerbox\">\n<div class=\"resetcss fr-view\">\n<p style=\"text-align:center;color:#000000;\"><strong>Polityka cookies</strong></p>\n<p style=\"text-align:center;color:#000000;\"><strong>sklepu internetowego</strong></p>\n<p style=\"text-align:center;color:#000000;\"><strong>numizmatyczny.com</strong></p>\n<p> </p>\n<ol>\n<li style=\"text-align:justify;color:#000000;\">Serwis numizmatyczny.com zbiera w sposób automatyczny wyłącznie informacje zawarte w tzw. plikach cookies.</li>\n<li style=\"text-align:justify;color:#000000;\">Pliki cookies to plikami tekstowe, które przechowywane są w urządzeniu końcowym użytkownika (np. komputerze czy smartfonie). Przeznaczone są do korzystania ze stron serwisu i zawierają przede wszystkim nazwę strony internetowej swojego pochodzenia, swój unikalny numer, czas przechowywania na urządzeniu końcowym.</li>\n<li style=\"text-align:justify;color:#000000;\">Administrator serwisu numizmatyczny.com jest podmiotem zamieszczającym na urządzeniu końcowym swojego użytkownika pliki cookies oraz mającym do nich dostęp.</li>\n<li style=\"text-align:justify;color:#000000;\">Administrator serwisu numizmatyczny.com korzysta z plików cookies w następujących celach:</li>\n</ol>\n<p style=\"padding-left:90px;text-align:justify;color:#000000;\">- dopasowania zawartości strony internetowej do preferencji użytkownika, przede wszystkim preferencji wyświetlania strony;</p>\n<p style=\"padding-left:90px;text-align:justify;color:#000000;\">- przygotowywania anonimowych statystyk, które umożliwiają dostosowanie zawartości i wyglądu serwisu do panujących trendów i potrzeb użytkowników;</p>\n<p style=\"padding-left:90px;text-align:justify;color:#000000;\">- możliwości logowania do serwisu;</p>\n<p style=\"padding-left:90px;text-align:justify;color:#000000;\">- utrzymania logowania użytkownika na każdej kolejnej stronie serwisu;</p>\n<p style=\"padding-left:90px;text-align:justify;color:#000000;\">- rejestrowania stanu „koszyka” z dodanymi do niego Produktami.</p>\n<ol start=\"5\">\n<li style=\"text-align:justify;color:#000000;\">Serwis stosuje dwa podstawowe rodzaje plików cookies – sesyjne i stałe. Pliki sesyjne są tymczasowe, przechowywane do momentu opuszczenia strony serwisu (przez wejście na inną stronę, wylogowanie lub wyłączenie przeglądarki). Pliki stałe przechowywane są w urządzeniu końcowym użytkownika do czasu ich usunięcia przez użytkownika lub przez czas określony w ich ustawieniach.</li>\n<li style=\"text-align:justify;color:#000000;\">Użytkownik może w dowolnym momencie dokonać zmiany ustawień swojej przeglądarki, aby zablokować obsługę plików cookies lub każdorazowo uzyskiwać informacje o ich umieszczeniu w swoim urządzeniu. Inne opcje można sprawdzić w ustawieniach przeglądarki internetowej. Należy pamiętać, że większość przeglądarek domyślnie pozwala na zapis plików cookies w urządzeniach końcowych użytkowników.</li>\n<li style=\"text-align:justify;color:#000000;\">Zmiana ustawień w przeglądarce internetowej może ograniczać dostęp do niektórych funkcji serwisu numizmatyczny.com.</li>\n<li style=\"text-align:justify;color:#000000;\">Pliki (cookies) z których korzysta serwis (zamieszczane w urządzeniu końcowym użytkownika) mogą być udostępnione jego partnerom oraz współpracującym z nim reklamodawcą.</li>\n<li style=\"text-align:justify;color:#000000;\">Informacje dotyczące ustawień przeglądarek internetowych dostępne są w menu pomoc lub na stronie wydawcy.</li>\n</ol>\n<p> </p>\n<p style=\"text-align:center;color:#000000;\"><strong>Klauzula informacyjna</strong></p>\n<p style=\"text-align:center;color:#000000;\"><strong>dot. plików cookies serwisu</strong></p>\n<p style=\"text-align:center;color:#000000;\"><strong>numizmatyczny.com</strong></p>\n<p> </p>\n<ol>\n<li style=\"text-align:justify;color:#000000;\">Administratorem Pani/Pana danych osobowych jest Jakub Starański prowadzący działalność gospodarczą pod firmą JS Partner Jakub Starański wpisaną do Centralnej Ewidencji i Informacji o Działalności Gospodarczej Rzeczypospolitej Polskiej prowadzonej przez ministra właściwego do spraw gospodarki, posiadająca: adres miejsca wykonywania działalności i adres do doręczeń: ul. Warszawska 26, Katowice (40 – 008), NIP: 6412419384, REGON: 243535017, adres poczty elektronicznej: sklep@numizmatyczny.com, numer telefonu: 512 353 791.</li>\n<li style=\"text-align:justify;color:#000000;\">Administrator zbiera dane osobowe wyłącznie w celu monitorowania ruchu na stronie, preferencji i ustawień użytkowników oraz prowadzenie statystyk i kampanii reklamowych.</li>\n<li style=\"text-align:justify;color:#000000;\">Administrator przetwarza dot. Pani/Pana dane osobowe na podstawie:\n<ol style=\"list-style-type:lower-alpha;color:#000000;\">\n<li>6 ust. 1 lit. a) RODO tj. zgody osoby, której dane dotyczą. Zgoda zostaje wyrażona za pomocą ustawień przeglądarki.</li>\n<li>6 ust. 1 lit. f) RODO tj. wykonywanie prawnie uzasadnionych interesów Administratora takich jak tworzenie statystyki prowadzenie kampanii reklamowych.</li>\n</ol>\n</li>\n<li style=\"text-align:justify;color:#000000;\">Odbiorcami dotyczących Pani/Pana danych osobowych może być Google LLC, dostawca takich narzędzi jak Google Adwords oraz Google Analytics – w odniesieniu do tego odbiorcy dane osobowe mogą być przekazywane do Stanów Zjednoczonych Ameryki na podstawie decyzji Komisji Europejskiej (Privacy Shield). Odbiorcą danych może być także Shoper.pl będący dostawcą oprogramowania do obsługi sklepu internetowego oraz Edrone Sp. z o.o., ul. Lekarska 1, 31-203 Kraków, NIP: 676-248-20-64, KRS: 0000537197: – w celach marketingowych tylko i wyłącznie na potrzeby kampanii emali, sms, social media uruchomionej lub wskazanej przez Administratora za pomocą systemu edrone.</li>\n<li style=\"text-align:justify;color:#000000;\">W przypadku danych przetwarzanych na podstawie zgody, Administrator przetwarza je do czasu jej wycofania, która w przypadku plików cookies polega na zmianie ustawień przeglądarki.</li>\n<li style=\"text-align:justify;color:#000000;\">Ma Pani/Pan prawo do:\n<ol style=\"list-style-type:lower-alpha;color:#000000;\">\n<li>żądania od Administratora dostępu do danych osobowych,</li>\n<li>żądania od Administratora sprostowania danych,</li>\n<li>żądania od Administratora usunięcia lub ograniczenia przetwarzania danych,</li>\n<li>wniesienia sprzeciwu wobec przetwarzania,</li>\n<li>przenoszenia danych osobowych,</li>\n<li>wniesienia skargi do Prezesa Urzędu Ochrony Danych Osobowych,</li>\n<li>cofnięcia zgody w dowolnym momencie, bez wpływu na zgodność z prawem przetwarzania, którego dokonano na podstawie zgody przed jej cofnięciem.</li>\n</ol>\n</li>\n<li style=\"text-align:justify;color:#000000;\">Przekazanie danych osobowych w postaci plików cookies jest fakultatywne. Odmowa zgody na ich przekazanie może skutkować niedostosowaniem strony do preferencji użytkownika.</li>\n<li style=\"text-align:justify;color:#000000;\">Administrator na podstawie pozyskanych danych nie podejmuje decyzji w sposób zautomatyzowany.</li>\n<li style=\"text-align:justify;color:#000000;\">Na podstawie zgromadzonych danych Administrator dokonuje profilowania, polegającego na wyświetlaniu spersonalizowanych reklam.</li>\n<li style=\"text-align:justify;color:#000000;\">Administrator informuje, że stosuje następujące technologie śledzące działania podejmowane przez użytkownika/Klienta w ramach strony internetowej Sklepu: kody śledzenia edrone – w celu analizy statystyk strony internetowej Sklepu, a także w celach marketingowych tylko i wyłącznie na potrzeby kampanii e-mali, sms, social media uruchomionej lub wskazanej przez Administratora za pomocą systemu edrone.</li>\n</ol>\n<p> </p>\n<p> </p>\n<p> </p>\n</div>\n</div>','cookies');
